//CUSTOM FUNCTIONS
function expDate(field, rules, i, options) {

    var expYear = jQuery("#years").val();
    var expMonth = jQuery("#months").val() * 1;
    expMonth = expMonth < 10 ? '0' + expMonth : expMonth;
    var exp_date = new Date('20' + expYear, expMonth);
    if (exp_date.getTime() < new Date().getTime()) {
        return 'Not a valid Expiration Date';
    }
}
function ccExpDate(field, rules, i, options) {

    var expYear = jQuery("#expirationDateYear").val();
    var expMonth = jQuery("#expirationDateMonth").val() * 1;
    expMonth = expMonth < 10 ? '0' + expMonth : expMonth;
    var exp_date = new Date('20' + expYear, expMonth);
    if (exp_date.getTime() < new Date().getTime()) {
        var msg = Drupal.settings.sushiTemplates.template_billing_inv_exp_date;
        return msg;
    }
}

function testCardNumberX(input) {
    input = input.val();
    input = input.replace(/[ -/]/g, '');
    var real = Signup.Authorize.AccountInfo.CardNumber;
    if (input.match(/x+/) && real) {
        real = real.toString();
        if (input.substring(input.length - 4, input.length) != real.substring(real.length - 4, real.length)) {
            return '* Not a valid Card Number';
        }
    }
}

function testCardNumber(input) {
    input = input.val();
    input = input.replace(/[ -/]/g, '');

    var sum = 0;
    var numdigits = input.length;
    var parity = numdigits % 2;
    for (var i = 0; i < numdigits; i++) {
        var digit = parseInt(input.charAt(i));
        if (i % 2 == parity) {
            digit *= 2;
        }
        if (digit > 9) {
            digit -= 9;
        }
        sum += digit;
    }
    if (sum % 10) {
        return '* Not a valid Card Number';
    }
}

function checkEmailRepeats(field, rules, i, options) {
    var email = jQuery('#email').val();
    //TODO: refactor this
    var valid = true;
    if (Signup.CartSummary.items.emailMarketing) {
        jQuery.each(Signup.CartSummary.items.emailMarketing, function(i, val) {
            if (val.email == email) {
                valid = false;
            }
        });
        if (!valid) {
            return 'This email address is already assigned <br> to another product you have in your cart.';
        }
    }
};

function phone(field, rules, i, options) {

    var phone = jQuery(field).val();
    var newPhone = '';

    for (var i = 0; i < phone.length; i++) {
        if ((phone[i].charCodeAt(0) > 47) && (phone[i].charCodeAt(0) < 58)) {
            newPhone += phone[i];
        }
    }
    if (newPhone.length < 10) {
        var msg = Drupal.settings.sushiTemplates.template_billing_inv_phone;
        return msg;
    }
}

function phoneE164(field, rules, i, options) {
    var phone = jQuery("#phone").val().toString();
    var country = jQuery("#country").val();

    if (country === "UK") {
        country = "GB";
    }
    var phoneToformat = formatE164(country, phone);

    if (isValidNumber(phone, country)) {
        jQuery("#phone").val(phoneToformat);
    } else {
        return '* Phone number is not valid for this country';
    }
}

function validPhone(field, rules, i, options) {
    var phone = jQuery(field).val().replace(/[^0-9]/g, '');
    console.log(phone);
    if (phone.length <= 10) {
        return '* Phone number is not valid';
    }
}



function isRealZip(field, rules, i, options) {
    //for personal info page
    var sCountry = jQuery('select[name="Country"]').val();
    //for billing page
    if (!sCountry) {
        if ('undefined' != typeof (curCountry)) {
            sCountry = curCountry;
        }
        else {
            sCountry = '';
        }
    }

    //if (/^united states$/i.test(sCountry)){
    if ('US' == sCountry) {
        if (!field.val().match(/[0-9]{5}.*/)) {
            return options.allrules.validateZip.alertText + 'United States';
        }
    }
    //if ('CA' == sCountry || 'Canada' == sCountry)
    //if (/^canada$/i.test(sCountry)) {
    if ('CA' == sCountry) {
        if (!field.val().match(/([A-Za-z][0-9]){3}|([A-Za-z][0-9][A-Za-z]\ [0-9][A-Za-z][0-9])/)) {
            return options.allrules.validateZip.alertText + 'Canada';
        };
    }
}

function checkDomainWithTld(field, rules, i, options) {
    var placeholder = field.attr('placeholder');/*"Enter the Domain you would like here...";for ie8*/
    var message = [];
    var text = field.val();
    var domain = text.split('.');

    if (domain.length != 2 && text != placeholder) {
        message.push(Drupal.settings.sushiTemplates.template_damain_validation2_wrong_domain);
    }
    if (domain[0].length < 2) {
        message.push('2 ' + Drupal.settings.sushiTemplates.template_validation_min_char);
    }
    if (domain[0].length > 63) {
        message.push('63 ' + Drupal.settings.sushiTemplates.template_validation_max_char);
    }
    if (!domain[0].match(/^[A-Za-z0-9]+[-A-Za-z0-9]*[A-Za-z0-9]+$/) && text != placeholder) {
        message.push(Drupal.settings.sushiTemplates.template_damain_validation2_spec_char);
    }
    if (domain[1] && -1 === jQuery.inArray(domain[1], TLDlist) && text != placeholder) {
        message.push(Drupal.settings.sushiTemplates.template_damain_validation2_tld_not_sup);
    }
    return message.join('<br>') || undefined;
};

function checkMonitorDomain(field, rules, i, options) {
    var message = [];
    var text = field.val();
    var domain = text.split('.');

    if (domain[1] && !domain[1].match(/(com|net)$/i)) {
        message.push('Domain Monitor could be set only for .com and .net top level domains');
    }

    return message.join('<br>') || undefined;
};

function checkGuardDomain(field, rules, i, options) {
    var message = [];
    var text = field.val();
    var domain = text.split('.');

    if (domain[1] && !domain[1].match(/(com|net|info|org)$/i)) {
        message.push('Domain Guard could be set only for .com .net .info .org top level domains');
    }

    return message.join('<br>') || undefined;
};


function checkDomainWithOrNoTld(field, rules, i, options) {
    if (field.val().length == 0) {
        return;
    }
    var placeholder = field.attr('placeholder');/*"Enter the Domain you would like here...";for ie8*/
    var message = [];
    var text = field.val();
    var domain = text.split('.');
    if (domain[0].length < 2) {
        message.push('2 ' + Drupal.settings.sushiTemplates.template_validation_min_char);
    } else if (domain[0].length > 63) {
        message.push('63 ' + Drupal.settings.sushiTemplates.template_validation_max_char);
    } else if (text.match(/\-$/)) {
        message.push(Drupal.settings.sushiTemplates.template_damain_validation_dash_cant_last);
    } else if (!domain[0].match(/^[A-Za-z0-9]+(\-?[A-Za-z0-9]+)*$/) && text != placeholder) {
        message.push(Drupal.settings.sushiTemplates.template_damain_validation_spec_char);
    } else if (text.match(/\.$/) && text != placeholder) {
        message.push(Drupal.settings.sushiTemplates.template_damain_validation_enter_tld);
    } else if (domain[1] && -1 === jQuery.inArray(domain[1], TLDlist)) {
        message.push(Drupal.settings.sushiTemplates.template_damain_validation_tld_not_sup);
    }
    setTimeout(function() {
        jQuery('.formError').css('opacity', 'none');
    }, 500);
    return message.join('<br>') || undefined;
};
