(function($) {
    $( document ).ajaxComplete(function( event, xhr, settings ) {
        var errorType='Error.General';
        switch (xhr.status) {
            default:
                var data = {
                        response:response,
                        url:settings.url
                    }
                if (settings.url.match(/bulkbuy/i)) {
                    errorType='Error.BulkBuy';
                    var response = '';
                    if (xhr.responseJSON) {
                        response = xhr.responseJSON;
                    }
                    else {
                        response = xhr.responseText;
                    }

                    sushiMemory.sendEvent({
                        event:errorType,
                        group:'AJAXError',
                        data:data
                    },{status:true});

                }
                else {
                    //errorType='Error.BulkBuy';
                    var response = '';
                    if (xhr.responseJSON) {
                        response = xhr.responseJSON;
                    }
                    else {
                        response = xhr.responseText;
                    }

                    sushiMemory.sendEvent({
                        event:errorType,
                        group:'AJAXError',
                        data:data
                    },{status:true});
                }


                break;
            case 200:
                //return;

                var response = {};
                if (xhr.responseJSON) {
                    response = xhr.responseJSON;
                }
                var data = {
                    response:response,
                    url:settings.url
                }
                if (response && response.success && response.success != 1) {

                    sushiMemory.sendEvent({
                        event:errorType,
                        group:'AJAXError',
                        data:data
                    });
                }
                else if(!response || !response.success){

                    /*sushiMemory.sendEvent({
                        event:'Notice',
                        group:'AJAXError',
                        data:data
                    });*/
                }


            break;
        }



    });

    $(document).ajaxError(function(e, jqxhr, settings, exception) {
            console.log(exception);
    });

    window.sushiMemory = new function() {
        this.sendEvent = function(obj,event_obj) {
            if (!obj.event.match(/(Domain.Search.Complete|Error|Purchase.Success.Detail)/i)) {
                if (!event_obj || !event_obj.status) {
                    return;
                }
            }

            if(!obj){
                return false;
            }
            if (!obj.event) {
                return false;
            }
            if (!obj.group) {
                obj.group = null;
            }
            if (!obj.data) {
                obj.data = null;
            }
            if (!obj.page) {
                obj.page = location.href;
            }
            var coupon = Signup.getModel('coupon')
            if (coupon) {
                coupon = coupon.getUserCoupons();
                if (coupon && coupon[0]) {
                    obj.coupon = coupon[0].code;
                }
            }


            var account = Signup.getModel('account');
            if (account) {
				var account_info = account.getAccountInfo();
				var account_NewAccount = account.getNewAccount();
				if (account_info.Username) {
					obj.account_id = account_info.Username;
				}
				if (account_info.Country && account_info.City && account_info.Address1) {
                    //[address 1], [address 2], [city], [state], [Country]
                    var address = account_info.Address1 + ' ' + (account_info.Address2=='NONE'?'':account_info.Address2);
                    address = address + ', ' + account_info.City + ', ' + account_info.Province + ', ' + account_info.Country;
					obj.address = address;
				}
				if (account_info.FirstName && account_info.LastName) {
					obj.full_name = account_info.FirstName + ' ' +account_info.LastName;
				}
				if (account_info.Email && account_info.Email != '') {
                    obj.email = account_info.Email;
                }
                else if (account_NewAccount.email) {
					obj.email = account_NewAccount.email;
				}

			}
            console.log(obj.event);
            switch (obj.event) {
                default:
                    break;
                case 'Tab.Active':
                    return;
                    break;
                case 'Cart.Updated':
                    obj.group = 'CartProducts';
                    if (obj.data && 'changeTerm' == obj.data.event) {
						obj.event = 'Cart.'+obj.data.event;
						obj.code = obj.data.product.pCode;
						obj.data.term = obj.data.product.term;
					}
                    else if (obj.data && ('add' == obj.data.event || 'remove' == obj.data.event)) {
                        obj.group = 'CartProducts';
                        obj.event = 'Cart.'+obj.data.event[0].toUpperCase() + obj.data.event.slice(1);
                        obj.code = obj.data.product.pCode;
                        obj.data = {
                            code:obj.data.product.pCode,
                            event:obj.data.event,
                            domain:obj.data.product.code.match(/\..+/)?obj.data.product.code:null
                        };
                    }
					else {
						return;
					}
                    break;
                case 'Cart.Add':
                case 'Cart.Remove':
                    /*obj.group = 'CartProducts';
                    obj.code = obj.data.code;
                    obj.data = {
                        code:obj.data.code,
                        event:obj.data.event
                    };*/
                    return;
                    break;
                case 'Domain.Search.Complete':
                    obj.group = 'DomainSearch';
                    var searchParams = Signup.getCtrl('domain').searchParams();
                    var domainStatus = Signup.getCtrl('domain').getDomainsStatus();
                    if(searchParams.domain && searchParams.tld){
                        obj.domain = searchParams.domain + '.' + searchParams.tld;

                        obj.availible = domainStatus[obj.domain];
                        obj.data = {
                            domain:obj.domain,
                            availible:obj.availible
                        };
                    }
                    break;
                case 'Coupon.Search.Success':
                        obj.group = 'CouponApply';
                        obj.coupon = obj.data.code;
                        obj.data = {
                            coupon:obj.data.code,
                            event:obj.event
                        };
                    break;
                case 'Purchase.Success':
                    obj.group = 'CartProducts';
					obj.account_id = obj.data.username;
					obj.transaction_id = obj.data.transactionid;
					var products = Signup.getModel('cart').getProductCodesInCart();

					for (var k in products ) {
						var new_obj = obj;
						new_obj.event = 'Purchase.Success.Detail';
						new_obj.code = products[k];
						new_obj.group = 'CartProducts';
                        new_obj.data = new_obj.code;
						sushiMemory.sendEvent(new_obj,{status:true});
					}
					break;
                case '404Error':
                    if(obj.data.source_url){
                        obj.source_url = obj.data.source_url;
                    }
                    break;
            }
            if (obj.data && obj.data.readyState) {
				obj.data = obj.data.responseText;
			}

            $.ajax({
                global: false,     // this makes sure ajaxStart is not triggered
                url:'/sushimemory/eventdata/'+obj.event+(obj.group?'/'+obj.group:''),
                method:'put',
                data:obj
            },function(){});



        }
    }
})(jQuery)
