function getSpan(date) {
    var _date = date.replace(/\-/g, '/'),
        now = new Date(),
        curr = new Date(_date),
        nowYear = now.getFullYear(),
        nowMonth = now.getMonth(),
        today = now.getDate(),
        cYear = curr.getFullYear(),
        cMonth = curr.getMonth(),
        cDay = curr.getDate(),
        years,
        months,
        days = cDay - today,
        expiresTime = ' ';
    if (0 > days) {
        days += new Date(cYear, cMonth + 1, 0).getDate();
        if (0 == cMonth) {
            cMonth = 11;
            cYear -= 1;
        } else {
            cMonth -= 1;
        }
    }
    months = cMonth - nowMonth;
    if (0 > months) {
        months += 12;
        cYear -= 1;
    }
    years = cYear - nowYear;

    if (0 < years) {
        expiresTime += years + ' year';
        if (1 < years) {
            expiresTime += 's';
        }
    }
    if (0 < months) {
        expiresTime += ' ' + months + ' month';
        if (1 < months) {
            expiresTime += 's';
        }
    }
    if (0 < days) {
        expiresTime += ' ' + days + ' day';
        if (1 < days) {
            expiresTime += 's';
        }
    }
    return expiresTime;
}

function getSpanDays(date) {
    var oneDay = 24 * 60 * 60 * 1000,
        now = new Date(),
        _date,
        curr,
        days = false;
    if (date && '' !== date) {
        _date = date.replace(/\-/g, '/');
        curr = new Date(_date);
        days = Math.ceil((now.getTime() - curr.getTime()) / oneDay);
    }
    return days;
}

