var Cart = function Cart(app) {
    var id = 1;
    var packages = [];
    var domains = [];
    var services = [];
    var bundles = [];

    var self = this;

    var setServIDs = function(product) {
        for (var i = 0, len = product.assignedProducts.length; i < len; i++) {
            var srv = product.assignedProducts[i];
            srv.id = srv.id || self.lastId();
            setServIDs(srv);
        }
    };

    var servicesChanged = function(eventType, product) {
        app.eventManager.dispatchEvent('Cart.Updated', {
            event: eventType.toLowerCase(),
            product: product
        });
    };

    this.lastId = function() {
        return id++;
    };

    this.addProduct = function(product) {
        if (false === product instanceof Product) {
            console.log(product, 'is not a product!');
            return false;
        }
        product.id = product.id || id++;
        product.changed = servicesChanged;
        setServIDs(product);
        switch (product.type) {
            case 'package':
                packages.push(product);
                break;
            case 'domain':
                domains.push(product);
                break;
            case 'service':
                services.push(product);
                break;
            case 'bundle':
                bundles.push(product);
                break;
            default:
                console.log(product, 'has unknown product type');
                return;
        }
        app.eventManager.dispatchEvent('Cart.Add', product);
        app.eventManager.dispatchEvent('Cart.Updated', {
            event: 'add',
            product: product
        });
        return product.id;
    };

    this.removeProduct = function(product) {
        var friends = [];
        switch (product.type) {
            case 'package':
                friends = packages;
                break;
            case 'domain':
                friends = domains;
                break;
            case 'service':
                friends = services;
                break;
            case 'bundle':
                friends = bundles;
                break;
            default:
                console.log(product, 'has unknown product type');
                return;
        }
        product.remove();

        for (var i = 0; i < friends.length; i++) {
            if (friends[i].id === product.id) {
                friends.splice(i, 1);
                app.eventManager.dispatchEvent('Cart.Remove', product);
                app.eventManager.dispatchEvent('Cart.Updated', {
                    event: 'remove',
                    product: product
                });
                return true;
            }
        }
        app.eventManager.dispatchEvent('Cart.Updated', {
            event: 'remove',
            product: product
        });
        return false;
    };

    this.updateProduct = function() {
        app.eventManager.dispatchEvent('Cart.Updated', {
            event: 'update'
        });
    };

    this.getAllProducts = function() {
        return [].concat(packages).concat(domains)
            .concat(services).concat(bundles);
    };

    this.getUniqueProducts = function() {
        var unique = [];
        var usedIDs = [];
        var findUnique = function(products) {
            for (var i = 0; i < products.length; i++) {
                if (-1 === usedIDs.indexOf(products[i].id) && !products[i].hidden) {
                    usedIDs.push(products[i].id);
                    unique.push(products[i]);
                    findUnique(products[i].assignedProducts);
                }
            }
        };
        findUnique(self.getAllProducts());

        return unique;
    };

    this.getProductById = function(id) {
        var products = self.getUniqueProducts();
        for (var i = 0; i < products.length; i++) {
            if (id == products[i].id) {
                return products[i];
            }
        }
        return false;
    };

    this.getProductsByType = function(type) {
        switch (type) {
            case 'package':
            case 'packages':
                return [].concat(packages);
            case 'domain':
            case 'domains':
                return [].concat(domains);
            case 'service':
            case 'services':
                return [].concat(services);
            case 'bundle':
            case 'bundles':
                return [].concat(bundles);
            default:
                return self.getUniqueProducts();
        }
    };

    this.getProductsByCode = function(code, type) {
        var products = self.getProductsByType(type);
        var result = [];
        if ('string' === typeof code) {
            code = [code];
        }
        for (var i = 0; i < products.length; i++) {
            if (-1 !== code.indexOf(products[i].code)) {
                result.push(products[i]);
            }
            if (-1 !== code.indexOf(products[i].pCode)) {
                result.push(products[i]);
            }
        }
        return result;
    };

    this.getProductByAttr = function(param, value) {
        if (!param || !value) {
            return [];
        }

        var products = self.getUniqueProducts();
        var rez = [];

        for (var i = 0, len = products.length; i < len; i++) {
            if (value === products[i].getParam(param)) {
                rez.push(products[i]);
            }
        }
        return rez;
    };

    this.getPrices = function() {
        var result = {
            full: 0,
            discount: 0,
            cDiscount: 0,
            iDiscount: 0,
            tax: 0,
            shipping: 0,
            total: 0
        };
        var couponCtrl = app.getCtrl('coupon');
        var products = self.getUniqueProducts();
        for (var i = 0; i < products.length; i++) {
            var prod = products[i];
            result.full += prod.price;
            result.discount += prod.discount;
            result.cDiscount += prod.cDiscount;
            result.iDiscount += prod.iDiscount;
            result.tax += prod.tax;
            result.shipping += prod.shipping;
            result.total += prod.totalPrice;
        }
        if (couponCtrl) {
            var transCoupon = couponCtrl.getTransactionCoupons();
            var transDiscount = {
                persent: 0,
                dollars: 0
            };
            transCoupon.forEach(function(coupon) {
                if (coupon.Discount_type !== "dollars") {
                    transDiscount.persent += parseFloat(coupon.Discount);
                } else {
                    transDiscount.dollars += parseFloat(coupon.Discount);
                }
            });
            transDiscount.total = transDiscount.dollars + (transDiscount.persent / 100 * result.total);
            result.cDiscount += transDiscount.total < result.total ?
                transDiscount.total : result.total;

            result.transDiscount = transDiscount.total < result.total ?
                transDiscount.total : result.total;

            result.total -= transDiscount.total < result.total ?
                transDiscount.total : result.total;
        }
        return result;
    };
    //notSave - if === true not write to localStorage
    this.save = function(notSave) {
        var products = this.getAllProducts();
        var usedIds = [];
        var cartData = [];

        var getProductData = function(product) {
            var info = {
                name: product.name,
                code: product.code,
                count: product.count,
                period: product.term,
                tax: product.taxRate(),
                type: product.type,
                existed: product.existed,
                hidden: product.hidden,
                services: [],
                options: product.options
            };
            if (product.existed) {
                info.linkto = product.linkto;
                info.hostedDomains = product.hostedDomains;
            }
            if (product.productName) {
                info.productName = product.productName;
                info.productId = product.productId;
            }
            switch (product.type) {
                case 'package':
                    info.assignOptions = product.assignOptions;
                    break;
                case 'domain':
                    info.regType = product.regType;
                    info.epp = product.epp;
                    if (product.isPremium) {
                        info.premium = product.isPremium;
                        info.premiumPrice = product.premiumPrice;
                    }
                    break;
                case 'service':
                    info.assignOptions = product.assignOptions;
                    break;
                default:
                    break;
            }
            for (var i = 0; i < product.assignedProducts.length; i++) {
                if (-1 === usedIds.indexOf(product.assignedProducts[i].id)) {
                    usedIds.push(product.assignedProducts[i].id);
                    info.services.push(getProductData(product.assignedProducts[i]));
                }
            }
            return info;
        };

        for (var i = 0; i < products.length; i++) {
            if (-1 === usedIds.indexOf(products[i].id)) {
                usedIds.push(products[i].id);
                cartData.push(getProductData(products[i]));
            }
        }
        if (true !== notSave) {
            localStorage.setItem('cart', JSON.stringify(cartData));
        }
        return cartData;
    };

    this.restore = function() {
        if (JSON.stringify(self.save(true)) == localStorage.getItem('cart')) {
            return;
        }
        var cartData = JSON.parse(localStorage.getItem('cart')) || [];
        var restoredDomains = [];
        var restoreProduct = function(pData) {
            try {
                var product = new Product(pData.code);
            } catch (e) {
                return false;
            }
            product.term = pData.period;
            product.tax = pData.tax;
            product.count = pData.count;
            product.existed = pData.existed;
            product.hidden = pData.hidden;
            if (pData.existed) {
                product.linkto = pData.linkto;
                product.hostedDomains = pData.hostedDomains;
            }
            if (pData.regType) {
                product.regType = pData.regType;
            }
            if (pData.epp) {
                product.epp = pData.epp;
            }
            if (pData.options) {
                product.options = pData.options;
            }
            if (pData.assignOptions) {
                product.assignOptions = pData.assignOptions;
            }
            if (pData.productName) {
                product.productName = pData.productName;
                product.productId = pData.productId;
            }
            if (pData.premium) {
                product.setPremium(true, pData.premiumPrice);
            }
            for (var i = 0; i < pData.services.length; i++) {
                var restored = restoreProduct(pData.services[i]);
                if (!restored) {
                    continue;
                }
                if ('domain' === restored.type) {
                    restoredDomains.push(restored.name);
                    self.addProduct(restored);
                }
                if (/YSSLCERT/.test(restored.code)) {
                    self.addProduct(restored);
                }
                product.assignProduct(restored);
            }
            product.id = id++;
            return product;
        };

        packages = [];
        domains = [];
        services = [];
        bundles = [];
        app.eventManager.off('Cart.Add');
        app.eventManager.off('Cart.Updated');
        for (var i = 0; i < cartData.length; i++) {
            if (cartData[i].type === 'domain') {
                if (-1 === restoredDomains.indexOf(cartData[i].name)) {
                    restoredDomains.push(cartData[i].name);
                }
                else {
                    continue;
                }
            }
            var restored = restoreProduct(cartData[i]);
            if (!restored) {
                continue;
            }
            self.addProduct(restored);
        }
        app.eventManager.on('Cart.Add');
        app.eventManager.on('Cart.Updated');
        app.eventManager.dispatchEvent('Cart.Updated', {
            event: 'restore'
        });
    };

    this.clear = function() {
        packages.length = 0;
        domains.length = 0;
        services.length = 0;
        bundles.length = 0;
        self.save();
    };

    this.buildForBulkBuy = function() {
        var data = {};
        var getPackageInfo = function(product) {
            var info = {
                _code: product.pCode || '',
                _description: product.description,
                _productName: product.name,
                _title: product.name,
                _productId: product.id,
                _duration: product.term,
                _options: product.options,
                _price: product.totalPrice,
                _icoupon: {
                    code: product.icoupon
                },
                _coupon: {
                    code: product.coupon.code
                },
                _assignDomains: [],
                _assignServices: []
            };
            if (product.existed) {
                info._linkto = product.linkto;
            }
            if (product.assignOptions) {
                info.assignOptions = product.assignOptions;
            }
            if (product.productname) {
                info._productName = product.productname;
                info._productId = product.productid;
            }
            product.assignedProducts.forEach(function(prod) {
                if ('domain' === prod.type) {
                    info._assignDomains.push(getDomainInfo(prod));
                } else {
                    info._assignServices.push(getServiceInfo(prod));
                }
            });
            return info;
        };
        var getDomainInfo = function(product) {
            var info = {
                _assignTo: {
                    code: (product.parent && product.parent.pCode) || 'YFREEPARKINGNOHOST'
                },
                _code: product.tld,
                _duration: product.term,
                _isFree: product.isFree,
                _registrationType: product.regType,
                _authCode: product.epp,
                _service: product.pCode,
                _title: product.name,
                _price: product.totalPrice,
                _icoupon: {
                    code: product.icoupon
                },
                _coupon: {
                    code: product.coupon.code || ''
                },
                _assignServices: []
            };
            product.assignedProducts.forEach(function(prod) {
                info._assignServices.push(getServiceInfo(prod));
                prod.assignedProducts.forEach(function(serv) {
                    info._assignServices.push(getServiceInfo(serv));
                });
            });
            return info;
        };
        var getServiceInfo = function(product) {
            var info = {
                _code: product.pCode,
                _duration: product.term,
                _price: product.totalPrice,
                _icoupon: {
                    code: product.icoupon
                },
                _coupon: {
                    code: product.coupon.code || ''
                }
            };
            if (typeof product.options !== 'undefined') {
                info._options = product.options;
            }
            if (typeof product.assignOptions !== 'undefined') {
                info._assignOptions = product.assignOptions;
            }

            return info;
        };
        var getBundleInfo = function(product) {
            var info = {
                _code: product.pCode,
                _duration: product.term,
                _price: product.totalPrice,
                _coupon: {
                    code: product.coupon.code || ''
                }
            };
            return info;
        };

        var products = this.getAllProducts();
        if (0 === products.length) {
            return false;
        }
        data.PromoCode = {
            internal:[],
            external:[]
        }; 
        products.forEach(function(product) {
            if (product.assignOptions || String(product.assignOptions) != 'undefined') {
                return false;
            }
            var type = product.type + 's';
            data[type] = data[type] || [];
            switch (product.type) {
                case 'package':
                    var info = getPackageInfo(product);
                    break;
                case 'domain':
                    var info = getDomainInfo(product);
                    break;
                case 'service':
                    if (false !== product.parent) {
                        return;
                    }
                    var info = getServiceInfo(product);
                    product.assignedProducts.forEach(function(serv) {
                        data[type].push(getServiceInfo(serv));
                    });
                    break;
                case 'bundle':
                    var info = getBundleInfo(product);
                    break;
                default:
                    return;
            }
            if(info._coupon.code != '') {
                data.PromoCode.external[info._coupon.code] = info._coupon.code;
            }
            if (info._icoupon != '') {
                data.PromoCode.internal[info._icoupon.code] = info._icoupon.code;
            }
            data[type].push(info);
        });
        var PromoCode = [];
        for(var code in data.PromoCode.internal ){
           PromoCode.push(code);
        }
        for(var code in data.PromoCode.external ){
           PromoCode.push(code);
        }
        if(PromoCode.length > 0) {
            data.PromoCode = PromoCode.join(',');
        }
        else {
            delete data.PromoCode; 
        }
        return data;
    };

    this.init = function() {
        self.restore();
    };
};
