function Domain() {
    var regType = 'registration';
    var term = parseInt(this.getParam('TermLength')) / 12;
    var parent = false;
    var EPP = null;
		var premium = false;
		var premiumPrice = 0;

    Object.defineProperty(this, 'type', {
        get: function () {
            return 'domain';
        }
    });
		Object.defineProperty(this, 'setPremium', {
        value: function (status, prPrice) {
            if (true === status){
							premium = true;
							premiumPrice = parseFloat(prPrice) || 0;
						} else {
							premium = false;
							premiumPrice = 0;
						}
        }
    });
		
		Object.defineProperty(this, 'isPremium', {
        get: function () {
            return premium;
        }
    });
		
		Object.defineProperty(this, 'premiumPrice', {
        get: function () {
            return premiumPrice;
        }
    });
    Object.defineProperty(this, 'tld', {
        get: function () {
            return this.getParam('Tld');
        }
    });
    Object.defineProperty(this, 'epp', {
        get: function () {
            return EPP || null;
        },
        set: function(val){
            EPP = val;
        }
    });

    Object.defineProperty(this, 'regType', {
        get: function () {
            return regType;
        },
        set: function (type) {
            //if unknown type set 'registration'
            regType = (type === 'transfer') ?
                type : (type === 'associate') ?
                type : 'registration';
        }
    });

    Object.defineProperty(this, 'description', {
        get: function () {
            return this.getParam('Description')
                .replace(/\d\s*years?/i, this.term + ' Year' + (this.term > 1 ? 's' : ''));
        }
    });

    Object.defineProperty(this, 'term', {
        get: function () {
            return term;
        },
        set: function (period) {
            if (this.availableTerms[period]){
                term = period;
            }
        }
    });

    /* can be free if assigned to hosting*/
    Object.defineProperty(this, 'isFree',{
        get: function () {
            return this.parent && this.parent.isServiceFree(this);
        }
    });

    Object.defineProperty(this, 'parent', {
        get: function () {
            return parent;
        },
        set: function (prod) {
            if (!prod && !parent){
                parent = false;
            } else if (!prod && parent && false === parent.findService(this)){
                parent = false;
            } else if (!parent && false !== prod.findService(this)){
                parent = prod;
            }
        }
    });

    Object.defineProperty(this, 'assignProduct',{
        value: function (product) {
            if (false === this.findService(product) && false === product.parent){
                this.assignedProducts.push(product);
                product.parent = this;
                this.changed && this.changed('Add', product);
            }
            
        }
    });
    Object.defineProperty(this, 'unAssignProduct', {
        value: function (product) {
            var indx = this.findService(product);
            if (false !== indx){
                this.assignedProducts.splice(indx, 1);
                product.parent = false;
            }
        }
    });

    return this;
};
