function Package() {
	if (false === this instanceof Product) {
		throw new Error('use new Product');
	}

	var maxDomains = /Accounts:(\d+)/i.exec(this.getParam('OptionString'));
	var freeDomains = /FreeDomainRegsCount:(\d+)/i.exec(this.getParam('OptionString'));
	//    var parent = false;
	var term = parseInt(this.getParam('TermLength'));
	var options, assignOptions;
	var alreadyHostedDomains = 0;
	var linkto = false;

	term = this.availableTerms[term] ? term : term / 12;

	var canBeFree = ['.com', '.net', '.org', '.info'];
	var free = [];

	maxDomains = maxDomains && parseInt(maxDomains[1]) || 0;
	freeDomains = freeDomains && parseInt(freeDomains[1]) || 0;

	if ('email' == this.getParam('SushiGroup').toLowerCase()) {
		maxDomains = 1;
	}

	// when Hosting have Atype: Forwarding and Regular
	var regularDomain = this.getParam('Atype');
	var type = this.getParam('type');
	if (type == 'package' && regularDomain && regularDomain != 'T') {
		maxDomains = 1;
	}

	Object.defineProperty(this, 'type', {
		get: function() {
			return 'package';
		}
	});

	Object.defineProperty(this, 'description', {
		get: function() {
			return this.getParam('Description');
		}
	});

	Object.defineProperty(this, 'isFree', {
		get: function() {
			return this.getParam['TPeriodDays'] > 0;
		}
	});

	Object.defineProperty(this, 'isServiceFree', {
		value: function(serv) {
			if (false !== this.findService(serv) && -1 !== free.indexOf(serv.name)) {
				return true;
			}
			return false;
		}
	});

	Object.defineProperty(this, 'term', {
		get: function() {
			return term;
		},
		set: function(period) {
			if (this.availableTerms[period]) {
				term = parseInt(period);
				this.updateInfo(this.availableTerms[term].code);
				maxDomains = /Accounts:(\d+)/i.exec(this.getParam('OptionString'));
				freeDomains = /FreeDomainRegsCount:(\d+)/i.exec(this.getParam('OptionString'));

				maxDomains = maxDomains && parseInt(maxDomains[1]) || 0;
				freeDomains = freeDomains && parseInt(freeDomains[1]) || 0;

				if ('email' == this.getParam('SushiGroup').toLowerCase()) {
					maxDomains = 1;
				}

				// when Hosting have Atype: Forwarding and Regular
				var regularDomain = this.getParam('Atype');
				var type = this.getParam('type');
				if (type == 'package' && regularDomain && regularDomain != 'T') {
					maxDomains = 1;
				}

				this.assignedDomains.forEach(function(domain) {
					this.unAssignProduct(domain);
					this.assignProduct(domain);
				}, this);
			}
		}
	});

	Object.defineProperty(this, 'parent', {
		get: function() {
			return false;
		},
		set: function() {
			console.log('package can\'t have parent');
		}
	});

	Object.defineProperty(this, 'assignProduct', {
		value: function(product) {
			if (product.parent) {
				console.log('unassign first');
				return;
			}
			if (false !== this.findService(product)) {
				console.log('already mine');
				product.parent = this;
				return;
			}
			if ('domain' !== product.type) {
				this.assignedProducts.push(product);
				product.parent = this;
				return;
			}
			if (maxDomains == (this.assignedDomains.length + alreadyHostedDomains)) {
				console.log('no more domains');
				return;
			}

			this.assignedProducts.push(product);
			product.parent = this;

			if (!product.existed && (free.length < freeDomains && -1 !== canBeFree.indexOf(product.tld))) {
				free.push(product.name);
			}
			return true;
		}
	});

	Object.defineProperty(this, 'domainsLimit', {
		get: function() {
			return maxDomains;
		}
	});

	Object.defineProperty(this, 'assignedDomains', {
		get: function() {
			return this.assignedProducts.filter(function(product) {
				return 'domain' === product.type;
			});
		}
	});
	Object.defineProperty(this, 'unAssignProduct', {
		value: function(product) {
			var indx = this.findService(product);
			if (false !== indx) {
				//cut from services array
				this.assignedProducts.splice(indx, 1);
				//remove parent from product
				product.parent = false;
				//check is product in free list
				indx = free.indexOf(product.name);
				if (-1 !== indx) {
					//cut if in free list
					free.splice(indx, 1);
					this.assignedProducts.forEach(function(prod) {
						if (free.length < freeDomains && -1 !== canBeFree.indexOf(prod.tld)) {
							free.push(prod.name);
						}
					});
				}
				return true;
			}
			return false;
		}
	});

	Object.defineProperty(this, 'hostedDomains', {
		get: function() {
			return alreadyHostedDomains;
		},
		set: function(val) {
			alreadyHostedDomains = parseInt(val) ? parseInt(val) : 0;
		}
	});
	Object.defineProperty(this, 'linkto', {
		get: function() {
			return linkto;
		},
		set: function(val) {
			linkto = val;
		}
	});
	Object.defineProperty(this, 'options', {
		get: function() {
			return options;
		},
		set: function(val) {
			options = val;
		}
	});
	Object.defineProperty(this, 'assignOptions', {
		get: function() {
			return assignOptions;
		},
		set: function(val) {
			assignOptions = val;
		}
	});

	return this;
};
