var Config = Config || {};
Config.pid = 1;
Config.pTypes = {
    package: ['hosting', 'mail'],
    domain: ['domain'],
    service: ['ssl', 'addon', 'privacy']
};

// @param 'code' - product code, but for domains "domain-name.org"
function Product(code){
    var pInfo = dataConf[code.replace(/^.+\.(?=[a-z]+$)/gi, '')];
    if (!pInfo){
        throw new Error('Can\'t find product info for', code);
    }

    var ID = Config.pid++;
    var terms = pInfo.availableTerms;
    var coupon = false;
    var icoupon = false;
    var tax = 0;
    var services = [];
    var shipping = 0;
    var count = 1;
    var existed = false;

    Object.defineProperty(this, 'getParam', {
        value: function (param) {
            return pInfo[param];
        }
    });

    Object.defineProperty(this, 'name', {
        get: function () {
            return 'domain' == this.type ? code : this.getParam('Name');
        }
    });
    
    Object.defineProperty(this, 'count', {
        get: function () {
            return count;
        },
        set: function (val){
            if (this.type !== 'domain' && parseInt(val) > 0){
                count = parseInt(val);
            }
        }
    });

    Object.defineProperty(this, 'code', {
        get: function () {
            return 'domain' == this.type ? code : this.pCode;
        }
    });

    Object.defineProperty(this, 'pCode', {
        get: function () {
            return pInfo.Code;
        }
    });   

	Object.defineProperty(this, 'aType', {
        get: function () {
            return pInfo.Atype;
        }
    });

    Object.defineProperty(this, 'id', {
        get: function () {
            return ID;
        },
        set: function (val) {
            ID = ID || val;
        }
    });

    Object.defineProperty(this, 'availableTerms', {
        get: function () {
            var result = JSON.stringify(terms);
            result = JSON.parse(result);
            delete result.min;
            return result;
        }
    });

    Object.defineProperty(this, 'findService', {
        value: function(serv) {
            for (var i = 0; i < services.length; i++) {
                if (serv.id === services[i].id){
                    return i;
                }
            }
            return false;
        }
    });
    
    Object.defineProperty(this, 'findServiceByBaseCode', {
        value: function(code) {
            code = code.replace(/\d/g, '');
            for (var i = 0; i < services.length; i++) {
                if (code === services[i].code.replace(/\d/g, '')){
                    return i;
                }
            }
            return false;
        }
    });
    
    Object.defineProperty(this, 'getAssignedCodes', {
        value: function() {
            var list = [];
            this.assignedProducts.forEach(function(serv){
                // this = list
                this.push(serv.pCode);
            }, list);
            return list;
        }
    });
    
    Object.defineProperty(this, 'getUnusedAddons', {
        value: function() {
            var list = [];
            var addons = pInfo.addons || {};
            var alreadyAssignedCodes = this.getAssignedCodes();
            
            Object.keys(addons).forEach(function(name){
                var addonsCodes = this[name].Products.split(',');
                addonsCodes.some(function(code){
                    return -1 !== alreadyAssignedCodes.indexOf(code);
                }) || list.push(name);
            }, addons);

            return list;
        }
    });

    Object.defineProperty(this, 'assignedProducts', {
        get: function () {
            return services;
        }
    });

    Object.defineProperty(this, 'updateInfo', {
        value: function (pcode) {
            if (pcode == this.availableTerms[this.term].code){
                pInfo = dataConf[pcode];
            }
        }
    });

    Object.defineProperty(this, 'coupon', {
        get: function () {
            return coupon;
        },
        set: function (val) {
            coupon = val;
        }
    });

    /* price = currentTerm * minTermPrice */
    Object.defineProperty(this, 'price', {
        get: function () {
            if (true === this.existed){
                return 0;
            }
						if (this.isPremium){
							return this.premiumPrice;
						}
            var term = this.term == 999 ? 1 : this.term;
            return roundTo(term * terms[terms.min].price, 2) * count;
        },
        configurable: true
    });
    /* discount = price - realTermPrice */
    /* if FREE discount = minPrice + price - realTermPrice */
    Object.defineProperty(this, 'discount', {
        get: function () {
            if (true === this.existed || this.isPremium){
                return 0;
            }
            return roundTo(this.isFree ?
                this.price + (terms[terms.min].price - terms[this.term].price) * count :
                this.price - terms[this.term].price * count, 2);
        }
    });
    
    /* internal coupon discount price */
    Object.defineProperty(this, 'iDiscount', {
        get: function () {
            var realPrice = roundTo(this.price - this.discount, 2);
            return this.getInternalDiscount(realPrice);
        }
    });
    
    Object.defineProperty(this, 'getInternalDiscount', {
        value: function(term_price) {
            
            if (!pInfo.DiscountCode || pInfo.DiscountCode == '') {
                return 0;
            }
            pInfo.Discount = parseFloat(pInfo.Discount);
                    
            var realPrice = term_price;
            if ('percent' === pInfo.DiscountType) {
                return pInfo.Discount >= 100 ? realPrice : roundTo(realPrice * pInfo.Discount / 100, 2);
            }
            return pInfo.Discount >= realPrice ? realPrice : pInfo.Discount;
        }
    });
    
    Object.defineProperty(this, 'icoupon', {
        get: function () {
            if (pInfo.DiscountCode && pInfo.DiscountCode != '') {
                return pInfo.DiscountCode;
            }
            return false;
        }
    });
    
    Object.defineProperty(this, 'shipping', {
        get: function(){
            return shipping || 0;
        },
        set: function(val){
            shipping = parseFloat(val) ? roundTo(val, 2) : 0;
        }
    });

    /* cDiscount = 0 : IF no coupon */
    /* cDiscount = (price - discount) * coupon.value /100 : IF PERCENT coupon(lt 100%) */
    /* cDiscount = coupon.value: IF DOLLAR COUPON */
    Object.defineProperty(this, 'cDiscount', {
        get: function () {
            if (!coupon) {
                return 0;
            }

            var realPrice = roundTo(this.price - this.discount - this.iDiscount, 2);
            if ('percent' === coupon.type) {
                return coupon.value >= 100 ? realPrice : roundTo(realPrice * coupon.value / 100, 2);
            }
            return coupon.value >= realPrice ? realPrice : coupon.value;
        }
    });

    Object.defineProperty(this, 'tax', {
        get: function () {
            return roundTo(tax * (this.price - this.discount - this.cDiscount), 2);
        },
        set: function (val) {
            if (parseFloat(val)) {
                tax = roundTo(val, 2);
            }
        }
    });

    Object.defineProperty(this, 'taxRate', {
        value: function(){
            return tax;
        }
    });

    Object.defineProperty(this, 'totalPrice', {
        get: function () {
            return this.price - this.discount - this.iDiscount - this.cDiscount + this.tax + this.shipping;
        }
    });
    
    Object.defineProperty(this, 'remove', {
        value: function(){
            if (this.parent){
                this.parent.unAssignProduct(this);
            }
            while(this.assignedProducts.length) {
                this.unAssignProduct(this.assignedProducts[0]);
            }
        }
    });
    
    Object.defineProperty(this, 'existed', {
        set: function(bool){
            existed = !!bool;
        },
        get: function(){
            return existed;
        }
    });

    //return Package(this);
    switch (pInfo.type){
        case 'package': return Package.call(this);
        case 'domain': return Domain.call(this);
        case 'service': return Service.call(this);
        case 'bundle': return Bundle.call(this);
        default: throw new Error('unknown product type');
    }
};
