var Signup = (function($){
    var App;

    var findEssence = function(cssAttr, internalName) {
        var _this = this;
        $('['+ cssAttr +']').each(function () {
            var name = $(this).attr(cssAttr);
            if (!_this[internalName][name]) {
                _this[internalName][name] = {};
            }
            if (!_this[internalName][name].list) {
                _this[internalName][name].list = [];
            }
            _this[internalName][name].list.push(this);
        });
    };

    var initEssences = function(internalName) {
        for (var item in this[internalName]) {
            if (this[internalName].hasOwnProperty(item)) {
                for (var i = 0, l = this[internalName][item].list.length; i < l; i++) {
                    initEssence.call(this, internalName, item, this[internalName][item].list[i]);
                }
            }
        }
    };

    var initEssence = function(internalName, name, DOM) {
        if (!this._constructors[internalName][name]) {
            return false;
        }
        if (!this[internalName][name].objects) {
            this[internalName][name].objects = [];
        }
        this[internalName][name].objects.push(new this._constructors[internalName][name](DOM));
    };

    App = function() {
        this._modules = {};
        this._services = {};
        this._models = {};
        this._controllers = {};
        this._constructors = {
            _services: {},
            _modules: {}
        };
        this.eventManager = new EventManager();
    };

    App.prototype.init = function () {
        findEssence.call(this, 'data-module', '_modules');
        findEssence.call(this, 'data-service', '_services');
        initEssences.call(this, '_modules');
        initEssences.call(this, '_services');
        this.eventManager.addListener('Signup.allSubmit','Signup.allSubmit', this.allSubmit.bind(this));
    };

    App.prototype.register = function(type, name, obj) {
        switch (type) {
            case 'model':
                this._models[name] = obj;
                break;
            case 'controller':
                this._controllers[name] = obj;
                break;
            case 'module':
                this._constructors._modules[name] = obj;
                break;
            case 'service':
                this._constructors._services[name] = obj;
                break;
            default:
                break;
        }
    };

    App.prototype.getModel = function(name) {
        return this._models[name];
    };

    App.prototype.getCtrl = function(name) {
        return this._controllers[name];
    };

    App.prototype.map = function(fn) {
        this.mapEssence('_modules', fn);
        this.mapEssence('_services', fn);
    };

    App.prototype.mapEssence = function(type, fn) {
        var itemName = null;
        for (itemName in this[type]) {
            if (this[type].hasOwnProperty(itemName)) {
                for (var i = 0, l = this[type][itemName].objects.length; i < l; i++) {
                    fn.apply(this[type][itemName].objects[i]);
                }
            }
        }
    };
    
    App.prototype.allSubmit = function() {
        var self     = this;        
        var promises = [];

        self.map(function() {
            if($(this.dom).is(":visible") || $(this.dom).attr('data-submit') === 'true') {
                promises.push(this.submit());
            }
        });

        $.whenAllDone.apply($, promises).then(function() {
            console.log('Success', arguments);
            self.eventManager.dispatchEvent('Signup.allSubmitSuccess', arguments);       
        }, function() {
            console.log('Failed', arguments);
            self.eventManager.dispatchEvent('Signup.allSubmitFaile', arguments);           
        });        
    };

    return new App();
})(jQuery);
;
jQuery(document).ready(function() {
    Signup.init();
});

