(function (app) {
	var cart = new Cart(app);
	cart.assignToHostings = function (domains) {
		if (!(domains instanceof Array)) {
			domains = [domains];
		}
		var packages = this.getProductsByType('package');
		var packsCount = packages.length;
		var domsCount = domains.length;
		var assignedCount = 0;
		var packagesInBundle = [];
		this.getProductsByType('bundle').forEach(function (bundle) {
			bundle.products.forEach(function (prod) {
				if ('package' === prod.getParam('PType').toLowerCase()) {
					packagesInBundle.push(prod);
				}
			});
		});
		packages = packages.concat(packagesInBundle);
		while (packsCount) {
			while (domsCount) {
				// ignore for new hosting with exist domain
				if(packages[packsCount - 1].assignOptions || String(packages[packsCount - 1].assignOptions) != 'undefined'){
					break;
				}
				if (packages[packsCount - 1].assignProduct(domains[domsCount - 1])) {
					domsCount--;
					assignedCount++;
				} else {
					break;
				}
			}
			packsCount--;
		}
		assignedCount > 0 && app.eventManager.dispatchEvent('Cart.Updated');
		return;
	};
	cart.assignToExistDomain = function (obj, currentHosting){
		var obj = obj || '';
		var currentHosting = currentHosting || '';
		var hosting = cart.getProductByAttr('SushiGroup', 'Hosting');
		var existDomain = false;
		var undefinedDomain = false;
		if(hosting.length > 0 && currentHosting && obj.domain && obj.utilDomain){
			for (var i=0; i < hosting.length; i++){
				if(hosting[i].assignOptions == obj.domain){
					existDomain = true;
					break;
				} 
			}
			if (existDomain == false){
				for (var i=0; i < hosting.length; i++){
					if(hosting[i].assignedProducts.length > 0){
						continue;
					}
					if (hosting[i].code == currentHosting && hosting[i].assignOptions == undefined){
						hosting[i].assignOptions = obj.domain;
						hosting[i].options = obj.utilDomain;
						undefinedDomain = true;
						break;
					}
				}
				if(undefinedDomain == false){
					for (var i=0; i < hosting.length; i++){
						if((hosting[i].code == currentHosting && hosting[i].assignOptions != obj.domain) || hosting[i].assignedProducts.length > 0){
							var product = new Product(currentHosting);
							product.assignOptions = obj.domain;	
							product.options = obj.utilDomain;
							cart.addProduct(product);
							break;
						}
					}
				}
				cart.updateProduct();
			}
		} 
	};
	cart.getProductCodesInCart = function (list) {
		var codes = [];
		var services = list !== undefined;
		list = list || this.getAllProducts();
		list.forEach(function (product) {
			if (!services && 'domain' == product.type && product.parent) {
				return;
			}
			codes.push(product.pCode);
			codes = codes.concat(cart.getProductCodesInCart(product.assignedProducts));
		});
		return codes;
	};
  cart.checkCart = function() {
      var products = cart.getProductsByType('packages');
      var result = {};
      products.some(function(prod) {
        switch (prod.code) {
          case 'MEMAILONLY3':
          case 'MEMAILONLY10':
          case 'MEMAILONLY100':
            if (0 === prod.assignedProducts.length) {
              result.message = prod.name + ' require a domain!';
              return true;
            }
            break;
        }
      });
      return undefined === result.message ? false : result;
  };
	cart.restore();
	app.eventManager.addListener('Cart.Updated', 'saveCart', cart.save.bind(cart));
	app.register('model', 'cart', cart);
})(Signup);;
(function(app, $) {
    var Coupon = (function (){
        var sysCoupon = localStorage.getItem('sysCoupon') || false,
            sysCouponData;
        var userCoupons = [];
        var userCouponsCodes = [];
        var restoredCount = 0;
        var discountCode = '';
        var getCouponData = function(code){
            discountCode = code;
            return $.ajax({
                url: '/api/?req=/db/suscoupons/discount/' + code + '.json',
                cache: false,
                dataType: 'JSON'
            });
        };
        var saveCouponData = function(discountInfo) {
            console.log(discountInfo);
            restoredCount++;
            userCoupons.length = 0;
            userCouponsCodes.length = 0;
            try {
                discountInfo.code = discountCode;
                if (discountInfo.code == sysCoupon){
                    sysCouponData = discountInfo;
                } else {
                    userCoupons.push(discountInfo);
                    userCouponsCodes.push(discountInfo.code);
                }
            } catch (err){
            } finally {
                localStorage.setItem('userCoupones', JSON.stringify(userCouponsCodes));
            }
        };
        // restoreCoupones
        (function (){
            var codes = localStorage.getItem('userCoupones');
            codes = (codes && JSON.parse(codes)) || [];
            if (sysCoupon){
                codes.push(sysCoupon);
            }
            if (codes.length > 0){
                var ajaxes = [];
                codes.forEach(function(code){
                    if(code) {
                        ajaxes[code] = getCouponData(code);
                        $.when(ajaxes[code])
                            .done(function(data) {
                                saveCouponData(data);
                            });
                    }
                    
                });
            }
            setTimeout(function(){
                if (codes.length > restoredCount){
                    setTimeout(arguments.callee, 300);
                } else {
                    app.eventManager.dispatchEvent('Cart.Updated');
                }
            }, 300);
        })();

        return {
            getSysCoupon: function(){
                if (sysCouponData){
                    return [sysCouponData];
                }
                return [];
            },
            getCouponData: getCouponData,
            saveCouponData: saveCouponData,
            getUserCoupons: function(){
                return [].concat(userCoupons);
            },
            getTransactionCoupons: function(){
                var coupons = [].concat(this.getUserCoupons()).concat(this.getSysCoupon());
                return coupons.filter(function(data){
                    return data.Coupon_type == 'Transaction';
                });
            }
        };
    })();
    
    app.register('model', 'coupon', Coupon);
})(Signup, jQuery);;
