(function(app, $) {
    var domain = (function () {
        var useGlobalAjax = true;
        var lookup 			= JSON.parse(localStorage.getItem('domain.search.lookup'))	|| [];
        var suggest 		= JSON.parse(localStorage.getItem('domain.search.suggest')) || [];
        var premium 		= JSON.parse(localStorage.getItem('domain.search.premium')) || {};
        var searchParams 	= JSON.parse(localStorage.getItem('domain.search.params')) 	|| {};
        var recentSearch 	= JSON.parse(localStorage.getItem('domain.recent.search')) 	|| [];
		var relatedDomains 	= JSON.parse(localStorage.getItem('domain.search.related')) || {};
        var getDomainsStatus   = function(){
            var rez = {};
            lookup.forEach(function(domain){
                rez[domain.name] = domain.status;
            });
            return rez;
        };
        var domainsStatus = getDomainsStatus();
        var domainIsHosted  = function(domain) {
            return $.ajax({
                url: Config.urls.rest_url,
                cache: false,
                data: 'req=/dns/Lookup/' + domain + '.json&type=GET',
                dataType: 'json'
            });
        };
        
        var transferRegistryStatus = function(domain) {
            return $.ajax({
                url: Config.urls.rest_url,
                cache: false,
                //data: 'req=/dns/registrycheck/all/' + domain + '.json&type=GET',
                data: 'req=/dns/transfercheck/' + domain + '.json&type=GET',
                dataType: 'json'
            });
        };
        
        var assocDomain = function(domain) {
            return $.ajax({
                url: Config.urls.rest_url,
                cache: false,
                data: 'req=/dns/lookup/' + domain + '.json&type=GET',
                dataType: 'json'
            });
        };
        
        var searchDomain = function(obj) {
            obj = obj || {};
            return $.ajax({
                url: Config.urls.search_domain + obj.domain + '.json&type=GET',
                dataType: 'json',
                global: useGlobalAjax,
            }).done(function(data){
                if (obj.type === 'registration') {
                    searchParams = obj;
                    localStorage.setItem('domain.search.params', JSON.stringify(searchParams));
                    updateRecentSearch(obj);
                }
                var message = data.message;
                if(message) {
                    if (message.lookup) {
                        lookup = message.lookup.filter(function(el){
                            return ((el || {}).name || '').replace(/\.[a-z]+$/, '') === obj.domain;
                        });
                        localStorage.setItem('domain.search.lookup', JSON.stringify(lookup));
                        domainsStatus = getDomainsStatus();
                    }
                    if (message.suggest) {
                        suggest = message.suggest;
                        localStorage.setItem('domain.search.suggest', JSON.stringify(suggest));
                        updateRelatedDomain(suggest);
                    }
                    if (message.premium) {
                        premium = {};
                        message.premium.forEach(function(elem, index) {
                            premium[elem.name] = elem.price;
                        });
                        localStorage.setItem('domain.search.premium', JSON.stringify(premium));
                    }
                }
            });
        };

        var updateRecentSearch = function (obj) {
			var data = obj.domain + '.' + obj.tld;
			var index = recentSearch.indexOf(data);
			var count = typeof SignupDrupalCustomScripts !== 'undefined' ? SignupDrupalCustomScripts.recentSearchCount : 10;
			var count = (typeof Drupal.settings[this.mId] !== 'undefined' && Drupal.settings[this.mId] !== null) ?
                parseInt(Drupal.settings.sushi_recent_search.recent_search_count) : 5;
			if ( index != '-1'){
				recentSearch.splice( index, 1 );	
			}
			
			recentSearch.push(data);
			
			if ( recentSearch.length > count - 1 ) {
				recentSearch = recentSearch.slice( 0 - count );
			}
			
			localStorage.setItem('domain.recent.search', JSON.stringify(recentSearch));
		};

		var updateRelatedDomain = function (suggest) {
            var count = typeof SignupDrupalCustomScripts !== 'undefined' ? SignupDrupalCustomScripts.recentSearchCount : 10;
			relatedDomains = new Array();
			for (key in suggest) {
				if (!suggest.hasOwnProperty(key)){
					continue;
				}
				relatedDomains[key] = {
					'domain_name': suggest[key].name
				};
				if (key == count - 1){
					break;
				}
			}
			localStorage.setItem('domain.search.related', JSON.stringify(relatedDomains));
		};

        return {
            getSearchLookup: function() {return lookup},
            getSearchSuggest: function() {return suggest},
            getSearchPremium: function() {return premium},
            getSearchParams: function() {return searchParams},
            searchDomain: searchDomain,
		    getRecentSearch: function() {return recentSearch},
			getRelatedDomains: function() {return relatedDomains},
            getDomainsStatus: function() {return domainsStatus},
            domainIsHosted: domainIsHosted,
            transferRegistryStatus: transferRegistryStatus,
            assocDomain: assocDomain,
            setGlobalAjax: function (status){
                useGlobalAjax = !!status;
            }
        };
    })();
    app.register('model', 'domain', domain);
})(Signup, jQuery);
