(function(app) {
    
    function cart() {
        this.model = app.getModel('cart');
    };
    
    /**
     * Get Domains from Model Cart by tld, 
     * @param {String|Array} tlds '.com,.net' or ['.com','.net']
     * @returns {Array}
     */
    cart.prototype.getDomainByTlds = function(tlds) {
    
        var domains      = [];
        var cart_domains = [];        
        var tlds_array   = typeof(tlds) === 'string'?tlds.split(','):tlds;
        
        if(!tlds_array instanceof Array || !tlds_array.length) {
            return [];
        }
        
        cart_domains = this.model.getProductsByType('domain');
        var j = 0;
        for(var i = 0, l = cart_domains.length; i < l; i++) {
            if(tlds_array.indexOf(cart_domains[i].tld) !== -1) {
               cart_domains[i].index = j++;
               domains[domains.length] = cart_domains[i];
            }          
        }
        
        return domains;
    };    

    app.register('controller', 'cart', new cart());
    
})(Signup);
