(function(app, $) {
  var modelDomain = app.getModel('domain');

  var domain = (function () {
    var validate = function(obj) {
      if (!(obj && obj.domain)) {
        return false;
      }
      return true;
    };

    var searchDomain = function(obj) {
      var $deff = new $.Deferred();
      app.eventManager.dispatchEvent('Domain.Search.Start', obj);
      $deff = modelDomain.searchDomain(obj);
      $.when($deff)
        .done(function(data) {
          app.eventManager.dispatchEvent('Domain.Search.Success', obj);
        })
        .fail(function(data) {
          app.eventManager.dispatchEvent('Domain.Search.Failed', obj);
        })
        .always(function(data) {
          app.eventManager.dispatchEvent('Domain.Search.Complete', obj);
        });
      return $deff.promise();
    };

    var assocDomain = function(domain) {
      var $deff = new $.Deferred();
      app.eventManager.dispatchEvent('Domain.Assoc.Start', {domain: domain});
      $deff = modelDomain.assocDomain(domain);
      $.when($deff)
        .done(function(data) {
          if (data.success && data.hosted == 'NO' && data.message != ''){
              app.eventManager.dispatchEvent('Domain.Assoc.Success', {domain: domain});   
          } else {
              app.eventManager.dispatchEvent('Domain.Assoc.Failed', {domain: domain});
          }
        })
        .fail(function(data) {
          app.eventManager.dispatchEvent('Domain.Assoc.Failed', {domain: domain});
        })
        .always(function(data) {
          app.eventManager.dispatchEvent('Domain.Assoc.Complete', {domain: domain});
        });
      return $deff.promise();
    };

    var transferFail = function(domain) {
      app.eventManager.dispatchEvent('Domain.Transfer.Failed', {domain : domain});
    };

    var transferDomain = function(params) {
      app.eventManager.dispatchEvent('Domain.Transfer.Start', {domain : params.domain});
      var $deff = new $.Deferred();
      $deff = modelDomain.domainIsHosted(params.domain);
      $.when($deff)
        .done(function(data) {
          if (data.success == 1 && data.hosted == 'NO') {
            var $Deff = new $.Deferred();
            $Deff = modelDomain.transferRegistryStatus(params.domain);
            $.when($Deff)
            .done(function(Data) {
              //if (Data.success == 1 && 'ok' == Data.all.registryStatus) {
              if (Data.success == 1 && 1 == Data.transferable_check.transferable) {
                app.eventManager.dispatchEvent('Domain.Transfer.Success', {domain : params.domain});
              } else {
                transferFail(params.domain);
              }
            }).fail(function(data) {
              transferFail(params.domain);
            });
          } else {
            transferFail(params.domain);
          }
        }).fail(function(data) {
          transferFail(params.domain);
        });
    };

    var findResult = function(){
      //TODO if no lookup at all
      var searched = searchParams();
      if (!searched.domain) {
        return 'start_find_domain';
      }
      var lookup = searchLookup();
      var searchedDomain = searched.domain + '.' + searched.tld;
      var l = lookup.length;
      if (!l) {
        return 'service_un_available';
      }
      for (var i = 0; i < l; i++) {
        if (lookup[i].name !== searchedDomain) {
          continue;
        } else {
          if (lookup[i].status === 'yes') {
            return 'available';
          } else {
            return 'not_available';
          }
        }
      }
      if(TLDlist.indexOf(searched.tld) !== -1) {
        return 'tld_not_returned';
      }
      return 'start_find_domain';
    };

    var searchParams = function() {
      return modelDomain.getSearchParams();
    };

    var searchLookup = function() {
      return modelDomain.getSearchLookup();
    };
    var searchPremium = function() {
      return modelDomain.getSearchPremium();
    };

    var recentSearch = function(){
      return modelDomain.getRecentSearch();
    };

    var relatedDomains = function () {
      return modelDomain.getRelatedDomains();
    };

    var getDomainsStatus = function (){
      return modelDomain.getDomainsStatus();
    };
    
    var domainImport = function(params) {
      app.eventManager.dispatchEvent('Domain.Import.Start', {domain : params.domain});
      var $deff1 = modelDomain.transferRegistryStatus(params.domain),
          $deff2 = modelDomain.assocDomain(params.domain);

      $.when($deff1, $deff2)
        .done(function(data2, data3) {
          var transfer = data2[0],
              assoc    = data3[0];
              
          if (transfer.success === '1' && '1' === transfer.transferable_check.transferable) {
            app.eventManager.dispatchEvent('Domain.Transfer.Success', {domain : params.domain});
          } else {
            if (assoc.success === '1' && assoc.hosted === 'NO' && assoc.message !== ''){
              app.eventManager.dispatchEvent('Domain.Import.Success', {domain: params.domain});
            } else {
              app.eventManager.dispatchEvent('Domain.Import.Failed', {domain: params.domain});
            }
          }
        })
        .fail(function(data2, data3) {
          transferFail(params.domain);
        });
    };

    return {
      searchDomain: searchDomain,
      transferDomain: transferDomain,
      searchParams: searchParams,
      searchLookup: searchLookup,
      searchPremium: searchPremium,
      findResult: findResult,
      recentSearch: recentSearch,
      relatedDomains:	relatedDomains,
      assocDomain: assocDomain,
      getDomainsStatus: getDomainsStatus,
      domainImport: domainImport
    };
  })();

  app.register('controller', 'domain', domain);
})(Signup, jQuery);
