(function(app, $) {
    var modelServices = app.getModel('services_setup');

    var services = (function() {
        var filterByService = function(params) {
            if (params.serviceCode.indexOf('DOMAINPRIVACY') !== -1) {
                params.serviceCode = 'DOMAINPRIVACY';
            }
            var domains = [];

            switch (params.serviceCode) {
                case 'DOMAINPRIVACY':

                    for (domain in params.domains) {
                        if (params.domains[domain].Domain.match(/\.(at|ca|de|eu|gr|nl|us|uk)$/i)
                            && $.inArray(params.domains[domain].Domain, params.filteredDomains) == -1) {
                            continue;
                        }

                        if (params.domains[domain] && 'Active' == params.domains[domain].DomainStatus) {
                            if (params.domains[domain].New || (params.domains[domain].SyncDate
                                && getSpanDays(params.domains[domain].SyncDate) <= 30)) {
                                domains.push(params.domains[domain].Domain);
                            }
                        }
                    }

                    break;
                case 'YDOMAINGUARD':
                    for (var i = 0; i < params.domains.length; i++) {
                        if (params.domains[i].Domain.match(/\.(com|net|info|org)$/i)
                            && $.inArray(params.domains[i].Domain, params.filteredDomains) == -1) {
                            domains.push(params.domains[i].Domain);
                        }
                    }
                    break;
                case 'YDOMAINMONITOR':
                    for (var i = 0; i < params.domains.length; i++) {
                        if (params.domains[i].Domain.match(/\.(com|net)$/i)
                            && $.inArray(params.domains[i].Domain, params.filteredDomains) == -1) {
                            domains.push(params.domains[i].Domain);
                        }
                    }
                    break;
                case 'YSITELOCKPRO':
                    var hostingProducts = ["YFREEPARKINGNOHOST", "YDNSONLY", "YURLFORWARD"]
                    for (var i = 0; i < params.domains.length; i++) {
                        if (hostingProducts.indexOf(params.domains[i].ProductCode) == -1 && params.filteredDomains.indexOf(params.domains[i].Domain) == -1) {
                            domains.push(params.domains[i].Domain);
                        }
                    }
                    break;
                default:
                    for (var i = 0; i < params.domains.length; i++) {
                        //if(params.domains[i].Domain.match(/\.(com|net)$/i) /*&& $j.inArray(params.domains[i].Domain,params.filteredDomains) == -1*/){
                        domains.push(params.domains[i].Domain);
                        //}
                    }
                    break;

            }
            return domains;

        };

        var getSpanDays = function(date) {
            var oneDay = 24 * 60 * 60 * 1000,
                now = new Date(),
                _date,
                curr,
                days = false;
            if (date && '' !== date) {
                _date = date.replace(/\-/g, '/');
                curr = new Date(_date);
                days = Math.ceil((now.getTime() - curr.getTime()) / oneDay);
            }
            return days;
        };

        var getDomains = function(params) {
            var getDomainsFunc = 'getDomains';
            if ('YDOMAINPRIVACY' === params.serviceCode) {
                getDomainsFunc = 'getDnsDomains';
            }
            var promises = [
                modelServices.getServices(params.serviceCode),
                modelServices[getDomainsFunc](params.serviceCode)
            ];

            $.when.apply($, promises).done(function(data) {
                var filteredDomains = modelServices.filteredDomains();
                var domains = modelServices.domains();
                var buildSelect = function() {
                    var resultDomains = filterByService({
                        serviceCode: params.serviceCode,
                        filteredDomains: filteredDomains,
                        domains: domains
                    });
                    params.buildSelect(resultDomains);
                };
                if ('YDOMAINPRIVACY' === params.serviceCode) {
                    var domainFunctions = [];
                    for (var domain in domains) {
                        if (domains[domain].ExpireDate && !domains[domain].SyncDate) {
                            domainFunctions.push(modelServices.getNewDomains(domains, domains[domain]))
                        }

                    }
                    $.when.apply($, domainFunctions).done(function() {
                        buildSelect();
                    }, function() {

                    });
                } else {
                    buildSelect();
                }

            }, function(data) {

            });
        };

        return {
            getDomains: getDomains
        };
    })();

    app.register('controller', 'services_setup', services);
})(Signup, jQuery);;
