	assocDomain.prototype.addProduct = function(domain) {
    var product = new Product(domain);
    product.regType = 'associate';
    modelCart.addProduct(product);
    modelCart.assignToHostings(product);
	};

  assocDomain.prototype.assocDomain = function() {
    var _this = this;
    var $domainField = _this.$dom.find('.js_assoc_domain_name');
    var domainName = $domainField.val();
    var result = ctrlDomain.assocDomain(domainName);
    result.done(function(data){
      if (data.success && data.hosted == 'NO' && data.message != ''){
        _this.addProduct(domainName);
        app.eventManager.dispatchEvent('Domain.Assoc.Redirect', {"mId": _this.mId});
      }else {
        if(Config.SHOP == false) {
          $($domainField).validationEngine(
            'showPrompt',
            'This domain is already hosted with us. Please login to your Control Panel to make changes to your hosting package.'
          );
          _this.$dom.find('.js_assoc_domain_name').val('');
        }
      }
    });
  };
  /**
   * Story509 - Review domain association module logic
   * Check domain for association
   * @author - Alexandr Chubirka
   */
  assocDomain.prototype.assocDomainNew = function() {
    var _this = this,
      $domainField = this.$dom.find('.js_assoc_domain_name'),
      domainName = $domainField.val(),
      result = ctrlDomain.assocDomain(domainName);

    result.done(function(data){
      if (data.taken == 'YES' && data.hosted == 'NO'){
        _this.addProduct(domainName);
        app.eventManager.dispatchEvent('Domain.Assoc.Redirect', {"mId": _this.mId});
      } else if (data.taken == 'NO' && data.hosted == 'NO') {
        _this.printErrorMessage(errors.no_assoc);
        _this.$dom.find('.js_assoc_domain_name').val('');
      } else if (Config.SHOP == false && data.hosted == 'YES') {
        _this.printErrorMessage(errors.hosted);
        _this.$dom.find('.js_assoc_domain_name').val('');
      }
    });
  };
  /**
   * ValidationEngine error output to the search field
   * @param {string} message - Error message
   */
  assocDomain.prototype.printErrorMessage = function(message) {
    var $domainField = this.$dom.find('.js_assoc_domain_name');
    $($domainField).validationEngine('showPrompt', message || 'Error');
  };

  assocDomain.prototype.init = function() {
    var _this = this;
    var $form = this.$dom.find('form');
    var $btn = this.$dom.find('.js_assoc_domain_btn')
    $btn.click(function(){
      if (!$form.validationEngine('validate')) {
        return false;
      }
      _this.assocDomainNew();
    });
    $form.submit(function(event) {
      event.preventDefault();
      event.stopPropagation();
    });
    this.$dom.find('.js_assoc_domain_name').keyup(function (e) {
      if (e.keyCode == 13) {
        $btn.trigger('click');
      }
    });

    $form.validationEngine('attach', {
      showOneMessage : true,
      scroll : false,
      promptPosition : 'topCenter',
      autoHidePrompt : true,
      autoHideDelay : 3000
    });
  };

  app.register('module', 'assoc_domain', assocDomain);
