(function(app,$){
    var accInfo, $form;
    var resetForm = false;
    var accountCtrl = app.getCtrl('account');
    var accountModel = app.getModel('account');
    
    var billing_address = function(dom){
        this.dom = dom;
        this.$dom = $(dom);
        this.init();
    };
    
    extend(billing_address, app._constructors._modules.main);
    
    var updateForm = function ($form, data) {
        data.PostalCode = (data.PostalCode === 'none') ? '' : data.PostalCode;              
        for( var name in data ){
            $form.find('input[name='+name+']').val(data[name]);
        }
    };
    
    var getAccountInfo = function (){
        accInfo = accountModel.getAccountInfo();
        if ( !Object.keys(accInfo).length ) {
            var newAccInfo = accountModel.getNewAccount();
            accInfo = {
                FirstName:  newAccInfo.name     || '',
                LastName:   newAccInfo.surname  || ''
            };
        }

        return accInfo;
    };

    var getCountryOptions = function (selected) {
        var countries = Config.Billing.countries;
        var data = [];
        for ( var key in countries ) {
            data.push({
                value: key,
                text: countries[key],
                selected: (key == selected)
            });
        }
        return data;
    };
    
    var getStateOptions = function (country,selected) {
        var states = (country == 'US' || country == 'CA') ? Config.Billing.states[country] : false;
        if (!states) return false;
        var data = [];
        for (var key in states) {
            data.push({
                value: key,
                text: states[key],
                selected: (key == selected)
            });
        }
        return data;
    };
    
    var buildCountry = function (country) {
        $form.find('select[name=Country]').setSelectOptions(getCountryOptions(country));
    };
    
    var buildState = function (country,state) {
        var stateOptions = getStateOptions(country,state);
        var $select = $form.find('select[name=Province]');
        var $input = $form.find('input[name=ProvinceText]');
        if(stateOptions){
            $input.hide();
            $select.show();
            $select.setSelectOptions(stateOptions);
        } else {
            $select.html('');
            $input.show();
            $select.hide();
            $input.val(state);
        }
    };
    
    var setAction = function ($form) {
        var _this = this;
        $form.focusout(function(){ 
            app.eventManager.off('account.accountInfo.update','BillingAddressRebuild');
            accountCtrl.updateAccountInfo($form.serializeObject());
            app.eventManager.on('account.accountInfo.update','BillingAddressRebuild');
            _this.validateZip();
        });
        $form.find('select[name=Country]').on('change', function(){
            buildState($(this).val());
        });
        
    };

    var setValidate = function ($form) {
        $form.validationEngine('attach', {
            showOneMessage : true,
            scroll : false,
            promptPosition : 'topCenter',
            autoHidePrompt : true,
            autoHideDelay : 3000
        });
    };
    
    billing_address.prototype.init = function () { 
        $form = this.$dom.find('.js_billing_address');
        this.build();
        setValidate($form);
        resetForm = true;
        app.eventManager.addListener('Login.Complete','BillingAddressRebuild',this.build.bind(this));
        app.eventManager.addListener('account.accountInfo.update','BillingAddressRebuild',this.build.bind(this));
        app.eventManager.addListener('CreateAccount.Complete','BillingAddressRebuild',this.build.bind(this));
    };
    
    billing_address.prototype.build = function () {
        $form.find('#zip').attr('class', $form.find('#zip').attr('class').replace('required,',''));
        $form.find('input[name=ProvinceText]').attr('class', $form.find('input[name=ProvinceText]').attr('class').replace('required,',''));
        accInfo = getAccountInfo();
        if (resetForm) $form[0].reset();
        var country = accInfo.Country || 'US';
        var state = accInfo.Province || '';
        buildCountry(country);
        buildState(country,state);
        updateForm($form, accInfo);
        setAction.call(this, $form);
    };

    billing_address.prototype.validateBilling = function () {
        if (this.validateZip()) {
            this.valid = $form.validationEngine('validate');
        } else {
            this.valid = false;
        }
        return this.valid;
    };
    
    billing_address.prototype.validateZip = function () {
        var $zip = $form.find('#zip');
        var zip = $zip.val();
        var country = $form.find('#country').val();
        var valid = true; 
        
        if ((/US|CA/.exec(country) !== null) && zip === '') {
            setTimeout(function() {
                $zip.validationEngine('showPrompt','* This field is required');
            }, 0);
            valid = false;
        }
        
        return valid;
    };
    
    billing_address.prototype.submit = function () {
        this.validateBilling();
        var $deff = new $.Deferred();
        if(this.valid) {
            $deff.resolve('billing_address: Ok');
        } else {
            var msg = 'no valid Form';//this.rejectMsg.join(',');
            $deff.reject('billing_address: Reject - ' + msg);
            this.rejectMsg = [];
        }
        return $deff.promise();
    };
    
    app.register('module', 'billing_address', billing_address);
    
})(Signup,jQuery);
