    cartPrices.prototype.buildPrices = function() {
        var prices = cartModel.getPrices();
        this.$dom.find('.js_full')
            .text('$' + this.preparePrice(prices.full)).closest('.js_priceRow')
        [prices.full !== prices.total ? 'show' : 'hide']();

        this.$dom.find('.js_discount')
            .text('$' + this.preparePrice(prices.discount + prices.iDiscount)).closest('.js_priceRow')
        [prices.discount > 0 || prices.iDiscount > 0 ? 'show' : 'hide']();

        this.$dom.find('.js_cDiscount')
            .text('$' + this.preparePrice(prices.cDiscount)).closest('.js_priceRow')
        [prices.cDiscount > 0 ? 'show' : 'hide']();

        this.$dom.find('.js_shipping')
            .text('$' + this.preparePrice(prices.shipping)).closest('.js_priceRow')
        [prices.shipping > 0 ? 'show' : 'hide']();

        this.$dom.find('.js_tax')
            .text('$' + this.preparePrice(prices.tax)).closest('.js_priceRow')
        [prices.tax > 0 ? 'show' : 'hide']();

        this.$dom.find('.js_total')
            .text('$' + this.preparePrice(prices.total));
    };
