        this.$dom.find('.js_discountPrice')
            .text('$' + this.preparePrice(prices.discount + prices.iDiscount))
            .closest('.js_priceRow')[prices.discount > 0 || prices.iDiscount > 0 ? 'show' : 'hide']();

