(function(app, $) {
    var cartModel = app.getModel('cart');
    var couponCtrl= app.getCtrl('coupon');
    var accountModel = app.getModel('account');
    var sysCoupon = sysCoupon || localStorage.getItem('sysCoupon') || false;
    var userCoupones = [];
    var Coupons = function(dom){
        this.dom = dom;
        this.$dom = $(dom);
        this.init();
    };
    
    extend(Coupons, app._constructors._modules.main);
    
    Coupons.prototype.init = function(){
        var self = this;
        this.$dom.find('.js_show_block, .js_cancel').click(function(){
            self.$dom.find('.js_open, .js_enter_block').slideToggle();
            self.$dom.find('.js_couponError').hide();
        });
        this.$dom.find('.js_apply').click(function(){
            self.applyCoupon(self.$dom.find('.js_coupon_code').val());
        });
        
        this.$saveBlock = this.$dom.find('.js_save_block');
        this.$couponsList = this.$dom.find('.js_coupons_list');
        this.$listItem = this.$couponsList.children().clone();
        this.$couponsDesc = this.$dom.find('.js_coupons_desc');
        this.$couponDesc = this.$dom.find('.js_desc').clone();
        
        app.eventManager.addListener('Coupon.Search.Success', 'applyCoupones', function(){
            self.applyCouponesToCart();
            self.$dom.find('.js_cancel').trigger('click');
        }, {priority: -1, status: true});
        app.eventManager.addListener('Coupon.Search.Success', 'hideCouponeError', function(){
            self.$dom.find('.js_couponError').hide();
        });
        app.eventManager.addListener('Coupon.Search.Failed', 'showCouponeError', function(){
            self.applyCouponesToCart();
            self.$dom.find('.js_couponError').show();
        });
        app.eventManager.addListener('Cart.Updated', 'applyCoupones',
            this.applyCouponesToCart.bind(this), {priority: -1, status: true});
        app.eventManager.addListener('CreateAccount.Complete', 'applyCoupones', this.applyCouponesToCart.bind(this));
        app.eventManager.addListener('Login.Success', 'applyCoupones', this.applyCouponesToCart.bind(this));
    };
    
    Coupons.prototype.applyCoupon = function (code){
        if (this.$dom.find('.js_coupon_code').validationEngine('validate') === false) {
          couponCtrl.findCoupon(code);
        }
    };
    
    Coupons.prototype.applyCouponesToCart = function (){
        var coupons = [].concat(couponCtrl.getUserCoupons())
            .concat(couponCtrl.getSysCoupon());
        var newCustomer = Object.keys(accountModel.getNewAccount()).length > 0;
        coupons = coupons.filter(function(el){
            return 'product' == el.Coupon_type.toLowerCase();
        }).filter(function(el){
            if (+el.NewCustomersPrivilege){
                return newCustomer;
            }
            return true;
        });
        var allProducts = cartModel.getUniqueProducts();
        var appliedCoupones = {};
        var suitableCodes = (function(){
            var rez = {};
            coupons.forEach(function(coupon){
                rez[coupon.code] = {
                    products: []
                };
                coupon.products.forEach(function(el){
                    rez[coupon.code].products.push(el.type_value);
                });
            });
            return rez;
        })();
        allProducts.forEach(function(product){
            if (product.isFree){
                return;
            }
            var maxDiscount = {
                code: '',
                discount: 0
            };
            var pCode = product.tld || product.code;
            product.coupon = false;
            var price = product.price - product.discount;
            coupons.forEach(function(coupon){
                if (-1 === suitableCodes[coupon.code].products.indexOf(product.tld || product.code)){
                    return;
                }
                var discount = coupon.Discount_type == 'dollars' ?
                    roundTo(coupon.Discount, 2) : 
                    roundTo(coupon.Discount / 100 * price, 2);
                if (maxDiscount.discount < discount){
                    var appliedCount = (appliedCoupones[coupon.code] 
                            && appliedCoupones[coupon.code][pCode]
                            && appliedCoupones[coupon.code][pCode].count
                            || 0);
                    if (+coupon.Coupon_restrict && coupon.Coupon_restrict <= appliedCount){
                        return;
                    }
                    maxDiscount.discount = discount;
                    maxDiscount.code= coupon.code;
                    maxDiscount.value = parseFloat(coupon.Discount);
                    maxDiscount.type = coupon.Discount_type;
                    maxDiscount.Description = coupon.Description;
                    maxDiscount.name = coupon.name;
                }
            });
            if (maxDiscount.discount == 0){
                return;
            }
            var cCode = maxDiscount.code;
            product.coupon = {
                code: cCode,
                name: maxDiscount.name,
                type: maxDiscount.type,
                description: maxDiscount.Description,
                value: maxDiscount.value
            };
            appliedCoupones[cCode] = appliedCoupones[cCode] || {};
            appliedCoupones[cCode][pCode] = appliedCoupones[cCode][pCode] || {count: 0};
            appliedCoupones[cCode][pCode].count++; 
        });
        this.buldCouponsList();
        // skip extra 'Cart.Updated' event
        app.eventManager.off('Cart.Updated', 'applyCoupones');
        app.eventManager.dispatchEvent('Cart.Updated');
        app.eventManager.on('Cart.Updated', 'applyCoupones');
    };
    var getCouponsData = function (){
        var products = cartModel.getUniqueProducts();
        var coupons = {};
        products.forEach(function(product){
            if (product.cDiscount){
                var coupon = product.coupon;
                coupons[coupon.code] = coupons[coupon.code] || {
                    discount: 0,
                    description: product.coupon.description
                };
                coupons[coupon.code].discount += product.cDiscount;
            }
        });
        var transDiscount = cartModel.getPrices().transDiscount;
        couponCtrl.getTransactionCoupons().forEach(function(coupon){
            var discount = 0;
            if ('percent' == coupon.Discount_type){
                discount = roundTo(transDiscount * coupon.Discount / 100);
            } else {
                discount = coupon.Discount < transDiscount ?
                        rountTo(coupon.Discount) : transDiscount;
            }
            coupons[coupon.code] = {
                discount: discount,
                description: coupon.Description
            };
        });
        return coupons;
    };
    Coupons.prototype.buldCouponsList = function (){
        var data = getCouponsData();
        var couponCodes = Object.keys(data);
        this.$couponsList.html('');
        this.$couponsDesc.html('');
        couponCodes.forEach(function(code){
            var info = data[code];
            var $listItem = this.$listItem.clone();
            var $desc = this.$couponDesc.clone().text(code + ' - ' + info.description);
            $listItem.find('.js_code').text(code);
            $listItem.find('.js_cDiscount').text('$' + info.discount.toFixed(2));
            this.$couponsList.append($listItem);
            this.$couponsDesc.append($desc);
        }, this);
        if (couponCodes.length > 0){
            this.$saveBlock.show();
        } else {
            this.$saveBlock.hide();
        }
    };

    app.register('module', 'coupon', Coupons);
})(Signup, jQuery);
