    var BuildYearsOptions = function (selected) {
        var currentYear = new Date().getFullYear();
        var data = [];
        var last2 = '';
       
        var i = currentYear;
        for ( i; i <= currentYear + 10; i++ ) {
            last2 = i.toString().substring(2);
            data.push({
                value: last2,
                text: i,
                selected: (last2 == selected)
            });
        }
        return data;
    }
    
    var BuildMonthsOptions = function (selected) {
        var months  = Config.Billing.months;
        var data    = [];
        var number  = '';
        for (var key in months) {
            number = parseInt(key) + 1;
            if (number < 10) number = '0'+number;
            data.push({
                value: number,
                text: number + ' - ' + months[key],
                selected: (selected == number)
            });
        }
        return data;
    }
