    plansAndPricing.prototype.addProduct = function() {
        var _this = this;
        return function(){
            var product = dataConf[$(this).attr('data-product-code')],
                product_addon = $(this).attr('data-addon');

            if (product_addon == '1') {
              app.eventManager.off('Signup.Modules.NextStep');
              app.eventManager.off('PlansAndPricing.Redirect');
            }

            switch(product.SushiGroup) {
                case 'SSL':
                    _this.addSsl(product);
                    break;
                case 'Fax':
                    _this.addFax(product);
                    break;
                case 'Domain Addon':
                    _this.addAddon(product);
                    break;
                case 'Domain Guard':
                    _this.addGuard(product);
                    break;
                case 'Domain Monitor':
                    _this.addMonitor(product);
                    break;
                case 'Domain Privacy':
                    _this.addPrivacy(product);
                    break;
                case 'SiteLock':
                    _this.addSiteLock(product);
                    break;
                case 'Email':
                    _this.addEmail(product);
                    break;
                case 'Bundle':
                    _this.addBundle(product);
                    break;
                case 'Hosting':
                    modelCart.addProduct(new Product(product.Code));
		                localStorage.setItem('CurrentCodeForCart', product.Code);
                    _this.assigAllDomainToHostings();
                    _this.redirect(product.SushiGroup);
                    break;
                case 'Logo':
                case 'Psprint':
                case 'LocalSync':
                default:
                    modelCart.addProduct(new Product(product.Code));
                    _this.redirect(product.SushiGroup);
                    break;
            };
            app.eventManager.dispatchEvent('Signup.Modules.NextStep', {mId: _this.mId});
            app.eventManager.on('Signup.Modules.NextStep');
            app.eventManager.on('PlansAndPricing.Redirect');
        }
    };

    plansAndPricing.prototype.emailInit = function() {
        if($('[data-product-code*="EMAILSTORAGE"]').length === 0) { return false; }
        var _this = this;
        var $deff = emailSetupModel.getEmails();
        $.when($deff)
            .done(function(emails){
                if (emails){
                    _this.checkEmail = true;
                }
            });
    };

    plansAndPricing.prototype.build = function() {
		var _this = this;
    var pm = Drupal.settings.product_manager;
		var $blocks = this.$dom.find('.js_product_block');
		var templateTitle = this.$dom.find('[template-id="product_title"]').html();
		var templatePrice = this.$dom.find('[template-id="product_price"]').html();
		var templatePriceRound = this.$dom.find('[template-id="product_price_round"]').html();
		var templateDesc = this.$dom.find('[template-id="product_description"]').html();
		var templateTerms = this.$dom.find('[template-id="product_terms"]').html();
        for (var i = 0, l = $blocks.length; i < l; i++) {
            var block = $($blocks[i]);
            var $blockPrice = block.find('.js_product_price');
            var $blockTerms = block.find('.js_product_terms');
            var $blockSale = block.find('.js_product_sale');
            var product = dataConf[block.find('.js_add_product').attr('data-product-code')];
            var editable = ( $(block).data('editable') == 1 || this.$dom.data('editable') == 1 );
            
            if (block.find('.js_add_product').attr('data-product-code') == 'template') {
              product = {
                Price: 'price',
                Name: 'Title',
                Description: 'Here will be the description of your product',
                SushiGroup: 'Template'
              };
            }
            
            if(product === undefined) {
                block.remove();
                continue;
            }
            if(product){
                var productForInfo = {};
                var productPrice = product.Price;
                var productDescription = editable ? block.find('.js_description').text().split(',') : product.Description.split(',');
                if(product.Code) {
                    try{
                        var terms = Object.keys(product.availableTerms);
                        productForInfo = new Product(product.Code);
                    } catch(e){
                        console.log('product.availableTerms is undef');
                    }
                    if($blockPrice.hasClass('js_monthly_price') || (product.SushiGroup === 'Hosting' && product.TermLength >= 12)) {
                        productPrice = parseFloat(productPrice) / parseFloat(product.TermLength);
                    }
                    if(productForInfo.iDiscount) {
                        productPrice = productPrice - productForInfo.iDiscount;
                        $blockSale.show();
                    }
                    productPrice = roundTo(productPrice, 2).toFixed(2).split('.');
                } else {
                    productPrice = [productPrice, ''];//default text
                }
                
                var desc = {description: []};
                for (var j = 0, k = productDescription.length; j < k; j++) {
                     desc.description.push({desc: $.trim(productDescription[j])});
                }
                if (!editable) block.find('.js_product_title').html(Mustache.render(templateTitle, {title: product.Name}));

                var priceTerm = 'per month';//'/mo';
                try{
                    if(typeof product.availableTerms.min !== 'undefined') {
                        priceTerm = product.availableTerms[product.availableTerms.min].period === '1 month' ? 'per month' : 'per year';//? '/mo' : '/yr'
                    }
                } catch(e){
                    console.log('product.availableTerms is undef');
                }
                $blockPrice.html(Mustache.render((pm.pricing_options && productPrice[1] == 00) ? templatePriceRound : templatePrice, {
                    price1: productPrice[0],
                    price2: productPrice[1],
                    term: priceTerm
                }));
                if (block.find('.js_description').is('li')) {
                  block.find('.js_description').remove();
                  $blockTerms.after(Mustache.render(templateDesc, desc));
                }

                /* Build terms */
                try{
                  if((product.availableTerms.min && terms.length > 2) ||
                      (typeof product.availableTerms.min === 'undefined' && terms.length > 1)) {
                      var selected = '';
                      var period = '/yr';
                      var termsData = {terms: []};
                      for (var t in product.availableTerms) {
                          if(!parseInt(t)) { continue; }
                          var term = product.availableTerms[t];
                          var productForInfoTerms = new Product(term.code);
                          var minPrice = parseFloat(product.availableTerms[product.availableTerms.min].price).toFixed(2);
                          var price = parseFloat(term.price) / parseFloat(t);
                          if(productForInfoTerms.iDiscount) {
                              price = price - productForInfoTerms.iDiscount
                          }
                          price = roundTo(price, 2).toFixed(2);
                          if(product.Code === term.code) {
                              selected = term.period;
                          }
                          if(term.period === '1 month') {
                              period = '/mo';
                          }
                          if(minPrice === price) {
                              minPrice = '';
                          } else if(parseFloat(minPrice) < parseFloat(price)) {
	                          minPrice = '';
                          }  else {
                              minPrice = '$'+ minPrice;
                          }
                          termsData.terms.push({
                              code: term.code,
                              term1: term.period,
                              term2: period,
                              price1: minPrice,
                              price2: price
                          });
                      }

                    $blockTerms.html(Mustache.render(templateTerms, termsData))
                        .click(function(event) {
                            event.stopPropagation();
                              $('.js_product_terms .js_dropdown').hide();
                              var $dropdown = $(this).find('.js_dropdown');
                              if ($dropdown.is(':visible')){
                                  $dropdown.hide();
                              } else {
                                  $dropdown.show();
                              }
                          });
                      $('body').click(function() {
                          $('.js_product_terms .js_dropdown').hide();
                      });
                      var productCodeForTerms = $blocks.find('.js_add_product').attr('data-product-code');
                      $blockTerms.find('.js_change_term[data-code=' + productCodeForTerms + ']').addClass('active');
                      $terms = $blockTerms.find('.js_change_term');
                      $blockTerms.find('.js_change_term').click(function(event) {
                          event.stopPropagation();
                          $(this).parent().find('.js_change_term').removeClass('active');
                          $(this).addClass('active');
                          var parent = $(this).parents('.js_product_block');
                          var newCode = $(this).attr('data-code');
                          var newTerm = $(this).attr('data-term');
                          var $btnAddProduct = parent.find('.js_add_product');
                          app.eventManager.dispatchEvent('PlansAndPricing.changeTerm', {
                              oldProduct: $btnAddProduct.attr('data-product-code'),
                              product: newCode,
                              term: newTerm,
                              event: 'changeTerm'
                          });
                          $btnAddProduct.attr('data-product-code', newCode);
                          parent.find('.js_selected').html(newTerm);
                          parent.find('.js_dropdown').hide();
                      });

                      $blockTerms.find('.js_dropdown').hide();
                      $blockTerms.find('.js_selected').html(selected);
                  } else {
                      $blockTerms.remove();
                  }
                } catch(e){
                    console.log('product.availableTerms is undef');
                }
                /* End Build terms */
                if (block.find('.js_add_product').attr('data-product-code') != 'template') {
                  if ( block.find('.js_add_product').attr('type') == 'checkbox' ){
                      block.find('.js_add_product[type=checkbox]').change(function(){
                          _this.appUpselProduct(this, _this);
                      });
                  } else {
                  block.find('.js_add_product').click(this.addProduct());
                  }
                }
            }
        }
    };

    plansAndPricing.prototype.appUpselProduct = function (dom, _this) {
        var $currentInput = $(dom);
        var oldValue = $currentInput.closest('.js_products_group').find('input:checkbox:checked').not($currentInput).attr('data-product-code');
        app.eventManager.off('Signup.Modules.NextStep');
        app.eventManager.off('PlansAndPricing.Redirect');
        $currentInput.closest('.js_products_group').find('input:checkbox').not($currentInput).removeAttr('checked');
        $currentInput.attr('checked', $currentInput.attr('checked'));
        $currentInput.unbind( 'click' );

        if ( undefined !== oldValue ) {
            _this.delProduct(oldValue);
        }
        var onOffButton = $(dom).prop('checked');
        if ( true === onOffButton ) {
            _this.addProduct().call(dom);
        } else {
            var productCode = $(dom).attr('data-product-code');
            _this.delProduct(productCode);
        }
        app.eventManager.on('Signup.Modules.NextStep');
        app.eventManager.on('PlansAndPricing.Redirect');
    };

    plansAndPricing.prototype.delProduct = function (productCode) {
        var product = modelCart.getProductsByCode(productCode, dataConf[productCode].PType);
        if ( 0 !== product.length ) {
            var product = product[0];
            modelCart.removeProduct(product);
        }
    };

    plansAndPricing.prototype.selectedPlan = function () {
        $.each(this.$dom.find('.js_add_product[type=checkbox]'), function (key, val) {
            var productCode = $(val).attr('data-product-code');
            var product = modelCart.getProductsByCode(productCode, dataConf[productCode].PType);
            if ( false === status ){
                if ( 0 !== product.length  ) {
                    $(val).attr('checked', 'checked');
                    status = true;
                }
            }
        });
    };

    plansAndPricing.prototype.init = function() {
        this.selectedPlan();
        this.build();
        this.emailInit();
        this.$dom.find('.js_fax_modal form').validationEngine('attach', {
			showOneMessage : true,
			scroll : false,
			promptPosition : 'topCenter',
			autoHidePrompt : true,
			autoHideDelay : 3000
		});
    };

	app.register('module', 'plans_and_pricing', plansAndPricing);

