(function(app, $) {
    var ctrlDomain = app.getCtrl('domain');
    var modelCart = app.getModel('cart');

    var searchDomain = function (dom) {
        this.dom = dom;
        this.$dom = $(this.dom);
        this.mId = this.$dom.attr('data-custom-id');
        this.config = {
            tlds: (typeof Drupal.settings[this.mId] !== 'undefined' && Drupal.settings[this.mId] !== null) ? 
                Object.keys(Drupal.settings[this.mId].tlds_checked)
                : ['com', 'net', 'org', 'info', 'biz', 'bz', 'ca', 'cc', 'co', 'mobi', 'tv', 'us', 'ws'],
            showDropdown: (typeof Drupal.settings[this.mId] !== 'undefined' && Drupal.settings[this.mId] !== null) ? 
                Drupal.settings[this.mId].hide_dropdown : 0,
            scrollTopAfterSearch : ['sushi_search_again']
        };
        this.init();
    };

    extend(searchDomain, app._constructors._modules.main);

    searchDomain.prototype.getDomainName = function() {
        var fullDomain = this.$dom.find('.js_search_domain_name').val().toLowerCase().split('.');
        return fullDomain[0] || this.$dom.find('.js_search_domain_name').val().toLowerCase();
    };

    searchDomain.prototype.getDomainTld = function() {
        var fullDomain = this.$dom.find('.js_search_domain_name').val().toLowerCase().split('.');
        return fullDomain[1] || this.$dom.find('.js_search_domain_tld').val() || 'com';
    };

    searchDomain.prototype.addProduct = function(domain) {
        var lookup = ctrlDomain.searchLookup();
        var premium = ctrlDomain.searchPremium();
        var lastBundle = localStorage.getItem('bundle.lastAdded');
        var addTo = this.$dom.attr('data-add-to');
        var addons = modelCart.getProductByAttr('SushiGroup', 'Addon');
        var addAfterSearch = localStorage.getItem('addAfterSearch');
        
        var add = function(product) {
            modelCart.addProduct(product);
            modelCart.assignToHostings(product);
            for (var k = 0, len = addons.length; k < len; k++) {
                product.assignProduct(new Product(addons[k].code));
                modelCart.removeProduct(addons[k]);
            }
        };
        
        if(premium[domain]) {
            var product = new Product(domain);
            product.setPremium(true, premium[domain]);
            add(product);
            return true;
        }
        
        for (var i = 0, l = lookup.length; i < l; i++) {
            if(lookup[i].name === domain && lookup[i].status === 'yes') {
                var product = new Product(domain);
                if(addTo) {
                    addTo = addTo.split('|');
                    if(addTo[0] === 'bundle' && lastBundle) {
                        var bundle = modelCart.getProductsByCode(lastBundle)[0];
                        var bundleSsl = bundle.getProductByAttr('SushiGroup', 'ssl')[0];
                        if(bundleSsl) {
                           product.assignProduct(bundleSsl);
                        }
                        if(addTo[1]) {
                            var bundleProduct = bundle.getProductByAttr('SushiGroup', addTo[1])[0];
                            if(bundleProduct.type === 'package') {
                                bundleProduct.assignProduct(product);
                            }
                            app.eventManager.dispatchEvent('Cart.Updated');
                            return true;
                        }
                        bundle.addProduct(product);
                        app.eventManager.dispatchEvent('Cart.Updated');
                        return true;
                    }
                }
                if(addAfterSearch) {
                    product.assignProduct(new Product(addAfterSearch));
                    localStorage.removeItem('addAfterSearch');
                }
                add(product);
                return true;
            }
        }
    };
    searchDomain.prototype.findDomain = function(domainName, domainTld) {
        var _this = this;
        var result = ctrlDomain.searchDomain({
            domain: domainName,
            tld: domainTld,
            type: "registration",
            module: _this.mId
        });
        result.done(function(data){
            _this.$dom.find('.js_search_domain_name').val('');
            _this.addProduct(domainName+'.'+domainTld);
            setTimeout(function(){
              app.eventManager.dispatchEvent('Domain.Search.Redirect', {"mId": _this.mId});
            }, 100);
        });
    };

    searchDomain.prototype.showDropdown = function() {
        if(this.config.showDropdown === 0) {
            this.$dom.find('.js_search_domain_name')
                .parent()
                .removeClass('small-9 medium-8')
                .addClass('small-12 medium-10')
            this.$dom.find('.js_search_domain_tld').parent().remove();
        }
    };

    searchDomain.prototype.build = function() {
        var $select = this.$dom.find('.js_search_domain_tld');
        var optionTemplate = this.$dom.find('[template-id="option"]').html();
        var options = '';
        var configTlds = this.config.tlds;
        for (var i = 0, l = configTlds.length; i < l; i++) {
            if(typeof dataConf[configTlds[i]] === 'undefined') { continue; }
            var tempOption = optionTemplate
                .replace('{{value}}', configTlds[i])
                .replace('{{display_value}}', '.' + configTlds[i]);
            options+= tempOption;
        }
        $select.html(options);
    };

    searchDomain.prototype.init = function() {
        var _this = this;
        var $form = this.$dom.find('form');
        var $btn = this.$dom.find('.js_search_domain_find_btn');
        var $field = this.$dom.find('.js_search_domain_name');
        this.build();
        this.showDropdown();
        $btn.click(function(){
            var domainName = _this.getDomainName();
            var domainTld = _this.getDomainTld();
            if (!$form.validationEngine('validate') || !domainName) {
                return;
            }
			
			if(modelCart.getProductsByCode(domainName + '.' + domainTld).length > 0) {
				$field.validationEngine('showPrompt','This domain has already been added to the cart');
				return false;
			}
			
            if(!domainTld) {
                $($field).validationEngine('showPrompt','please specify domain tld');
                return;
            }
            $field.blur();
            _this.findDomain(domainName, domainTld);
        });
        $form.submit(function(event) {
            event.preventDefault();
            event.stopPropagation();
        });
        $field.bind('keypress', function (event) {
            if (event.keyCode == 13) {
                $btn.trigger('click');
            }
        });

        $form.validationEngine('attach', {
            showOneMessage : true,
            scroll : false,
            promptPosition : 'topCenter',
            autoHidePrompt : true,
            autoHideDelay : 3000
        });
        
        app.eventManager.addListener('Domain.Search.Complete', 'searchResultsReBuild', function(params) {
            if(_this.config.scrollTopAfterSearch.indexOf(params.module) !== -1) {
               $('html, body').animate({ scrollTop: 0 }, 'slow');
            }
        });
    };

    app.register('module', 'search_domain', searchDomain);
})(Signup, jQuery);
