(function(app, $) {
    var ctrlDomain = app.getCtrl('domain');
    var searchResults = function (dom) {
        this.dom = dom;
        this.$dom = $(this.dom);
        this.init();
    };
    extend(searchResults, app._constructors._modules.main);
    searchResults.prototype.init = function() {
        this.build();
        app.eventManager.addListener('Domain.Search.Success', 'searchResultsReBuild', this.build.bind(this));
    };
    searchResults.prototype.build = function() {
        var searchParams = ctrlDomain.searchParams();
        var premium = ctrlDomain.searchPremium();
        var result = ctrlDomain.findResult();

        var $resultText = this.$dom.find('.js_search_result_text');
        var availableTemplate = this.$dom.find('[template-id="available"]').html();
        var notAvailableTemplate = this.$dom.find('[template-id="not_available"]').html();
        var premiumTemplate = this.$dom.find('[template-id="premium"]').html();
        var serviceUnAvailableTemplate = this.$dom.find('[template-id="service_unavailable"]').html();
        var tldNotReturnedTemplate = this.$dom.find('[template-id="tld_not_returned"]').html();
        var findFirst = this.$dom.find('[template-id="find_first"]').html();

        switch (result) {
            case 'available':
                $resultText.html(
                    availableTemplate.replace(
                        '{{domain_with_tld}}',
                        searchParams.domain + '.' + searchParams.tld
                    )
                );
                break;
            case 'not_available':
                var domain = searchParams.domain+'.'+searchParams.tld;
                if(premium[domain]) {
                    $resultText.html(
                       premiumTemplate.replace(
                          '{{domain_with_tld}}',
                          domain
                       ).replace(
                          '{{premium_price}}',
                          premium[domain]
                       ).replace(
                          '{{price}}',
                          dataConf[searchParams.tld].Price
                       )
                   );
                } else {
                   $resultText.html(
                       notAvailableTemplate.replace(
                          '{{domain_with_tld}}',
                          domain
                       )
                   ); 
                }
                break;
            case 'service_un_available':
                $resultText.html(serviceUnAvailableTemplate);
                break;
            case 'tld_not_returned':
                $resultText.html(
                    tldNotReturnedTemplate.replace(
                        '{{domain_with_tld}}',
                        searchParams.domain + '.' + searchParams.tld
                    )
                );
                break;
            case 'start_find_domain':
            default:
                $resultText.html(findFirst);
                break;
        }
    };
    app.register('module', 'search_results', searchResults);
})(Signup, jQuery);
