(function (app, $) {
	var emptyMsg = 'Your cart is empty. Please add a product to your cart.';
	var cartModel = app.getModel('cart');
	var simpleCart = function (dom) {
		this.dom = dom;
		this.$dom = $(dom);
		this.init();
	};
	var repeatParent = [
		'YDEDICATEDIP1', 'YDEDICATEDIP2',
		'YDEDICATEDIP3', 'YDEDICATEDIP5',
		'YSITELOCKBASIC'
	];
	extend(simpleCart, app._constructors._modules.main);

	simpleCart.prototype.init = function () {
		var self = this;
		this.settings = Drupal.settings.cart_simple_module || {
			cart_delete: 1,
			cart_terms: 1,
			cart_terms_prices: 1
		};
		this.$productblock = $(this.$dom.find('#product_row').html());
		this.$customSelect = $(this.$dom.find('#termsSelect').html());
		this.$productsList = this.$dom.find('.js_products_list');
		this.$popup = this.$dom.find('.reveal-modal');

		this.$popup.find('.js_cancel').unbind().bind('click', function () {
			self.$popup.foundation('reveal', 'close');
		});

		this.$customSelect.click(function () {
			var $dropdown = $(this).find('.js_dropdown');
			if ($dropdown.is(':visible')) {
				$dropdown.hide();
			} else {
				$dropdown.show();
			}
		}).mouseleave(function () {
			var $dropdown = $(this).find('.js_dropdown');
			$dropdown.hide();
		});

		//TODO: hide terms/remove when it will be in settings
		if (0 === this.settings.cart_terms) {
			this.$dom.find('.js_head').find('.js_termsHead').hide();
		}
		this.buildCart();
		app.eventManager.addListener('Cart.Updated', 'buildSimpleCart', this.buildCart.bind(this));
	};

	simpleCart.prototype.buildCart = function () {
		var products = cartModel.getUniqueProducts();

		if (0 === products.length) {
			this.$dom.find('.js_head').hide();
			this.$productsList.text(emptyMsg);
			return;
		}
		this.$dom.find('.js_head').show();
		var $list = $('<div/>');
		for (var i = 0, len = products.length; i < len; i++) {
			$list.append(this.buildProductRow(products[i]));
		}
		this.$productsList.html($list.children());
	};

	var buildDescription = function (product, $ul) {
		var desc = product.description;
		desc = desc.replace(/\s*includes:\s*/i, '');
		if (/\n/.test(desc)) {
			desc = desc.split(/\n/g);
		} else {
			desc = desc.split(/\s*,\s+(?=[^a-z])/g);
		}
		$ul.html('');

		if ('string' == typeof desc) {
			$ul.append($('<li/>').text(desc));
		} else {
			for (var i = 0, len = desc.length; i < len; i++) {
				var txt = $.trim(desc[i]);
				if (txt.length > 0) {
					$ul.append($('<li/>').text(txt));
				}
			}
		}

		return $ul;
	};
	var getDiscountReason = function (product) {
		if (product.isFree) {
			return 'domain' == product.type ?
							(1 == product.term ? 'Free with hosting!' : false) :
							'Free for ' + product.getParam('TPeriodDays') + ' days!';
		} else if (product.coupon) {
			return product.coupon.code + ' applied!';
		}
		else if (product.iDiscount > 0) {
			return 'Sale';//product.icoupon + ' Sale';
		}
		return false;
	};
	simpleCart.prototype.buildProductRow = function (product) {
		var self = this;
		var $row = this.$productblock.clone();
		var discountText = getDiscountReason(product);
		var newPrice = product.isFree ?
						'FREE' : '$' + product.totalPrice.toFixed(2);

		if ( product.hidden || ( product.existed && 0 === product.price && 'domain' === product.type ) ) {
			$row.hide();
		}

		buildDescription(product, $row.find('.js_productDesc'));
		$row.find('.js_productName').text(product.name);
		if (this.settings.cart_delete && -1 === repeatParent.indexOf(product.code)) {
			$row.find('.js_productRemove').click(function () {
				if (!self.buildRemovePopup(product, $row)) {
					$row.css('animation-iteration-count', '1').addClass('animated lightSpeedOut');
					setTimeout(function () {
						cartModel.removeProduct(product);
					}, 500);
				}
			});
		} else {
			$row.find('.js_productRemove').hide();
		}
		$row.find('.js_oldPrice').text('$' + this.preparePrice(product.price));
		$row.find('.js_productTerms').html(this.buildTerms(product));
		if (discountText) {
			$row.find('.js_freeReason').text(discountText);
			$row.find('.js_newPrice').text(newPrice).show();
		} else {
			$row.find('.js_newPrice').hide();
			$row.find('.js_oldPrice').css('text-decoration', 'none');
		}
		return $row;
	};
	simpleCart.prototype.buildRemovePopup = function (product, $row) {
		var self = this;
		if (!this.$popup.length) {
			return false;
		}
		this.$popup.find('.js_productName').text(product.name);
		this.$popup.find('.js_remove').unbind().click(function () {
			self.$popup.foundation('reveal', 'close');
			setTimeout(function () {
				$row.css('animation-iteration-count', '1').addClass('animated lightSpeedOut');
				setTimeout(function () {
					cartModel.removeProduct(product);
					$('#footer').place_footer();
				}, 500);
			}, 400);			
		});
		this.$popup.foundation('reveal', 'open');
		return true;
	};
	simpleCart.prototype.buildTerms = function (product) {
		var $select = this.$customSelect.clone(true);
		var $options = $select.find('.js_dropdown');
		var availableTermsInfo = product.availableTerms;
		var minTerm = availableTermsInfo.min;

		delete availableTermsInfo.min;

		var availableTerms = Object.keys(availableTermsInfo);

		if (1 >= availableTerms.length || !this.settings.cart_terms
				|| -1 !== repeatParent.indexOf(product.code) || product.isPremium) {
			return '&nbsp;';
		}

		minTerm = minTerm || Math.min.apply(null, availableTerms);
		var $option = $options.children(':first').clone();
		var basePrice = availableTermsInfo[minTerm].price;
		var basePriceTxt = '$' + this.preparePrice(basePrice);

		var basePeriod = availableTermsInfo[minTerm].period.indexOf('month');
		basePeriod = basePeriod === -1 ? '/yr' : '/mo';

		$select.find('.js_selected').text(availableTermsInfo[product.term].period);
		$options.html('');
		for (var i = 0, len = availableTerms.length; i < len; i++) {
			var $opt = $option.clone();
			var term = availableTerms[i];
			var termInfo = availableTermsInfo[term];
			var newPrice = roundTo(termInfo.price / term, 2);
			if(product.iDiscount > 0) {
				 newPrice = roundTo((termInfo.price - product.getInternalDiscount(termInfo.price))/availableTerms[i], 2);
			}
			$opt.find('.js_period').text(termInfo.period);
			$opt.find('.js_maxPrice').text(basePriceTxt);
			if (newPrice !== basePrice) {
				$opt.find('.js_thisPrice').text('$' + this.preparePrice(newPrice)).show();
			} else {
				$opt.find('.js_maxPrice').css('text-decoration', 'none');
				$opt.find('.js_thisPrice').hide();
			}
			$opt.click({term: term}, function (e) {
				if (product.term !== e.data.term) {
					product.term = e.data.term;
					product.assignedProducts.forEach(function (serv) {
						if (-1 !== repeatParent.indexOf(serv.code)) {
							serv.term = product.term;
						}
					});
					app.eventManager.dispatchEvent('Cart.Updated', {
						product: product,
						event: 'changeTerm'
					});
				}
				$options.find('.active').removeClass('active');
				$(this).addClass('active');
			});
			if (term == product.term) {
				$opt.addClass('active');
			}
			if (0 === this.settings.cart_terms_prices){
				$opt.find('.js_extend').hide();
			}
			$options.append($opt);
		}
		$select.find('.js_basePeriod').text(basePeriod);
		return $select;
	};
  simpleCart.prototype.preparePrice = function(price) {
    var strPrice = ""+price;
    var pricing_options = Drupal.settings.product_manager.pricing_options;
    var arrPrice = strPrice.split('.');
    if (pricing_options === 1 && arrPrice[1] == '00' || arrPrice.length == 1) {
      return arrPrice[0];
    }

    return price.toFixed(2);
  };
	app.register('module', 'cart_simple', simpleCart);
})(Signup, jQuery);
