(function(app, $) {
    var cartModel = app.getModel('cart');
    var autologin = function (dom) {
        this.dom = dom;
        this.$dom = $(this.dom);
        this.mId = this.$dom.attr('data-custom-id');
        this.init();
    };
    var hasLogo = function (){
        return cartModel.getProductsByType('package').some(function(prod){
            return /^T.+LOGO$/.test(prod.code);
        });
    };
    var hasSsl = function (){
        return cartModel.getProductsByType('package').some(function(prod){
            return /^YSSLCERT/.test(prod.code);
        });
    };

    extend(autologin, app._constructors._modules.main);

    autologin.prototype.init = function(){
        var self = this;
        this.$form = this.$dom.find('.js_form');
        this.$standart = this.$dom.find('.js_standart');
        this.$sbsWait = this.$dom.find('.js_wait');
        this.$done = this.$dom.find('.js_done');
        this.$ceativeBrief = this.$dom.find('.js_cb');
        this.$dom.find('.js_LogIn_CB, .js_LogIn').click(function(){
            self.$form.submit();
        });
        app.eventManager.addListener('Purchase.Success', 'fillAutologin',function(data){
            if ('sbs' === Config.cp_type){
                self.$standart.show();
                self.$sbsWait.show();
                self.$done.hide();
                setTimeout(self.showResults, 60000);
            } else {
                self.showResults();
            }
            self.buildForm(data);
            if(!+Config.SHOP){
              setTimeout(function(){localStorage.clear()}, 2000);
            }
        });
    };
    autologin.prototype.showResults = function (){
        if (hasLogo()){
            this.$ceativeBrief.show();
            this.$standart.hide();
        } else {
			this.$standart.show();
            this.$sbsWait.hide();
            this.$done.show();
        }
    };

    autologin.prototype.buildForm = function (data){
        var urls = Config.urls;
        var action = urls.login_cp;
        var pass = localStorage.getItem('BasePSWD');
        pass = $.base64.decode(pass);
        action += hasSsl() ? "?code=DOMAIN" : '';
        this.$form.prop('action', action);
        this.$form.find('.js_user').val(data.username);
        this.$form.find('.js_pass').val(pass);
        if (hasLogo()){
            this.$form.find('.js_hash').val(urls.login_cb_hash);
            this.$form.find('.js_customError').val(urls.login_cb_cerror);
        }
    };


    app.register('module', 'autologin', autologin);
})(Signup, jQuery);
