    hosting.prototype.buildHosting = function(){
    	var self = this;
    	var currentHostings = ctrlHosting.getServices();
        if(!currentHostings || Object.keys(currentHostings).length === 0) {
            self.$dom.hide();
            return;
        }
        self.$dom.find('.js_current_hosting').html('');
    	for(var i in currentHostings){
    		try{
				var domain_length = currentHostings[i].domains.length;
				var prod_dom_length = currentHostings[i].DomainLimit;
				var prod_name = dataConf[currentHostings[i].code].Name;
				var availibl_domains = ctrlHosting.availiblDomains(domain_length,prod_dom_length);
				if(availibl_domains != 0 ){
					self.$dom.find('.js_current_hosting').append(
						'<option value="'+currentHostings[i].code + '|' +
						currentHostings[i].domain + 
						'|' + availibl_domains+'">' + prod_name + 
						' [(' + currentHostings[i].domain +') ' + 
						availibl_domains + ' domain' + (availibl_domains>1?'s':' ') + ' available]</option>');
				}
			} catch(e){
				console.log(e);
			}
		}
    };
    
    hosting.prototype.addHosting = function() {
        var pack = this.$dom.find('.js_current_hosting').val().split('|');
        var util_dom = pack[1];
        var code = pack[0];
        var av_dom = pack[2];
        var OptionString = dataConf[code].OptionString;
        var data = OptionString.split(' ');
        var FreeDomainRegsCount = 0;
        var Accounts = 0;
        for (var i=0;i<data.length;i++){
            if(data[i].match(/FreeDomainRegsCount/)){
                FreeDomainRegsCount = data[i].split(':')[1];
            }
            if(data[i].match(/Accounts/)){
                var Accounts = data[i].split(':')[1];
            }
        }
        var count_domains = Accounts - av_dom;
        
        var product = new Product(code);
        product.hostedDomains = (FreeDomainRegsCount-count_domains)<0?0:(FreeDomainRegsCount-count_domains);
        product.accounts = av_dom;
        product.existed = true;
        product.linkto = util_dom;
        modelCart.addProduct(product);
        app.eventManager.dispatchEvent('Signup.Modules.NextStep', {mId: this.mId});
    };

    hosting.prototype.init = function() {
    	var self = this;
        ctrlHosting.getCurrentHosting(function(){self.buildHosting()});
        this.$dom.find('.js_use_exist_host').click(this.addHosting.bind(this));
        app.eventManager.addListener('Cart.Updated', 'WebchatSetupBuild', function(){
            ctrlHosting.getCurrentHosting(function(){self.buildHosting()});
        });
    };

    app.register('module', 'existing_hosting', hosting);
