    extend(transferDomainResult, app._constructors._modules.main);

	transferDomainResult.prototype.addProduct = function(domain, epp) {
        var product = new Product(domain);
        product.regType = 'transfer';
        product.epp = epp;
        if(modelCart.getProductsByCode(domain).length > 0) {
            return false;
        }
        modelCart.addProduct(product);
        modelCart.assignToHostings(product);
        app.eventManager.dispatchEvent('Domain.Transfer.Complete', { product: product });
        this.avaliableBlock.hide();
        this.noneAvaliableBlock.hide();
	};
    transferDomainResult.prototype.transferAvaliable = function(params) {
        var _this = this;
        _this.avaliableBlock.show();
        _this.noneAvaliableBlock.hide();
        $('#assoc_domain_result').siblings('#continue_btn2').hide();
        _this.$dom.find(".js_transfer").unbind().bind('click', function (event) {
            event.preventDefault();
            event.stopPropagation();
            if(_this.$dom.find('.js_dont_epp').is(':checked')) {
                _this.addProduct(params.domain, null);
            } else {
                var epp = _this.$dom.find('.js_epp_input').val();
                if (epp == '') {
                    return;
                }
                _this.addProduct(params.domain, epp);
            }
            _this.avaliableBlock.show();
            if(Drupal.sushiFlow.current() < Drupal.sushiFlow.wizard.tabs.length){
                app.eventManager.dispatchEvent('Signup.allSubmit');
            } else {
                app.eventManager.dispatchEvent('Domain.Transfer.Redirect', {"mId": _this.mId});
            }

        });
    };

    transferDomainResult.prototype.transferNoneAvaliable = function(params) {
        this.avaliableBlock.hide();
        this.noneAvaliableBlock.show();
    };

