(function(app, $) {
  var ctrlDomain = app.getCtrl('domain');
  var modelCart = app.getModel('cart');
  
  var domainImport = function (dom) {
    this.dom = dom;
    this.$dom = $(this.dom);
    this.mId = this.$dom.attr('data-custom-id');
    this.init();
  };

  extend(domainImport, app._constructors._modules.main);
  
  domainImport.prototype.addProduct = function(domain) {
    var product = new Product(domain);
    product.regType = 'associate';
    modelCart.addProduct(product);
    modelCart.assignToHostings(product);
	};
  
  domainImport.prototype.init = function() {
    var _this = this;
    var $domainField = _this.$dom.find('.js_domain_import_domain_name');
    var $form = this.$dom.find('.js_domain_import_form');
    var $btn = this.$dom.find('.js_domain_import_btn');
    $btn.unbind().bind('click', function(){
      if (!$form.validationEngine('validate') || !$domainField.val()) {
        return false;
      }
      ctrlDomain.domainImport({ domain: $domainField.val() });
    });
    $form.submit(function(event) {
      event.preventDefault();
      event.stopPropagation();
    });
    $($domainField).keyup(function (e) {
      if (e.keyCode == 13) {
        $btn.trigger('click');
      }
    });
      
    $form.validationEngine('attach', {
      showOneMessage : true,
      scroll : false,
      promptPosition : 'topCenter',
      autoHidePrompt : true,
      autoHideDelay : 3000
    });
    app.eventManager.addListener('Domain.Import.Success','domainImportSuccess', function(data) {
      _this.addProduct(data.domain);
      app.eventManager.dispatchEvent('Domain.Assoc.Success', {domain: data.domain}); 
      Drupal.sushiFlow.NextStep();
    });
    app.eventManager.addListener('Domain.Import.Failed','domainImportFailed', function(data) {
      if(Config.SHOP == false) {
        $($domainField).validationEngine('showPrompt',
            'This domain is already hosted with us. Please login to your Control Panel to make changes to your hosting package.');
        $($domainField).val('');
      }
      app.eventManager.dispatchEvent('Domain.Assoc.Failed', {domain: data.domain}); 
    });
  };

  app.register('module', 'domain_import', domainImport);
})(Signup, jQuery);
