    main.prototype.checkParentInCart = function(productGroup) {
        if (!productGroup || typeof productGroup != 'string') {
            return false;
        }
        try {
            var cart = Signup.getModel('cart');
            var Products = cart.getProductsByType(productGroup);
            if (Products.length == 0) {
                return false;
            }
            return true;
        } catch(e) {
            console.log(e);
            return false;
        }
        
    }

    app.register('service', 'main', main);
