(function(app, $) {
    $(function() {
        var modelAccount = app.getModel('account');
        var modelCart = app.getModel('cart');
        var cart_abandonment_service = new function () {
            this.email = '';
            this.submited = false;
            this.action = false;
            this.send = function(action, updateCart) {
                var _this = this;
                var data = {
                    cart: localStorage.getItem('cart') || {},
                    action: 'post',
                    email: modelAccount.getNewAccount().email || modelAccount.getAccountInfo().Email || this.email,
                    newCart: true
                };
                if(this.email) {
                    data.action = 'put';
                }
                if(action) {
                    data.action = action;
                }
                if(!data.email) {
                    return false;
                }
                if(_this.submited === true && _this.action === data.action) { return false; }
                app.eventManager.dispatchEvent('Service.Cart.Abandonment');
                $.ajax({
                    url: Config.urls.rest_url + '?req=/db/signup/cartinfo/',
                    dataType: 'JSON',
                    data: 'data=' + JSON.stringify(data),
                    type: 'POST',
                    global: false,
                    success: function (cartInfo) {
                        if (cartInfo.error){
                            return;
                        }
                        if ('get' == data.action && updateCart && cartInfo.Cart && cartInfo.Cart[0]){
                            app.eventManager.off('Cart.Updated', 'cartAbandonment');
                            localStorage.setItem('cart', JSON.stringify(cartInfo.Cart[0]));
                            modelCart.restore();
                            app.eventManager.on('Cart.Updated', 'cartAbandonment');
                        }
                        if ('post' == data.action && 0 == cartInfo.success){
                            _this.send('put');
                        }
                    }
                });
                _this.submited = true;
                _this.action = data.action;
                setTimeout(function() {
                    _this.submited = false;
                }, 1000);
            };

            this.init = function() {
                var _this = this;
                var clientEmail = /clientEmail=([^&]+)/.exec(location.search);
                if($.isArray(clientEmail)) {
                    this.email = $.base64.decode(clientEmail[1]);
                    this.send('get', true);
                }
                var options = {
                    priority: 10000,
                    status: true
                };
                app.eventManager.addListener('Cart.Updated','cartAbandonment', function() {
                    setTimeout(function() {
                       _this.send(); 
                    }, 15);
                }, options);
                app.eventManager.addListener('Login.Complete','cartAbandonment', function() {
                    setTimeout(function() {
                       _this.send('post');
                    }, 15);
                }, options);
                app.eventManager.addListener('Purchase.Success','cartAbandonment', function() {
                    setTimeout(function() {
                       _this.send('delete');
                    }, 15);
                }, options);
                
            };
        };

        cart_abandonment_service.init();
    });
})(Signup, jQuery);;
(function(app, $) {
    var modelCart = app.getModel('cart');
    var landingPage = function (dom) {
        this.$dom = $($(dom).html());
        this.init();
    };
    extend(landingPage, app._constructors._services.main);
    
    landingPage.prototype.addFax = function(product) {
        var $modal = this.$dom.find('.js_fax_modal');
        $modal.find('.js_fax_type').text(product.Code.replace('MFAX', ''));
        $modal.foundation('reveal', 'open');
        
        $modal.find('.js_fax_modal_close').click(function() {
            $modal.foundation('reveal', 'close');
        });
        $modal.find('.js_fax_save').click(function() {
            if (!$modal.find('form').validationEngine('validate')) {
                return false;
            }
            var fax = new Product(product.Code);
            fax.options = {
                domain: $modal.find('.js_fax_email').val(),
                password: $modal.find('.js_fax_pass').val()
            };
            modelCart.addProduct(fax);
            $modal.foundation('reveal', 'close');
        });
    };
    
    landingPage.prototype.addFaxHosting = function (product) {
        var $modal = $('#id-fax-hosting-modal'),
            regExpFaxLimit = (/\d+0/),
            faxHosting = new Product(product.Code),
            faxServiceCode = product.Code.replace('NOHOST', ''),
            faxLimit = (regExpFaxLimit.exec(product.Code) || [])[0],
            fax = null;
    
        if (dataConf[faxServiceCode] && 'FAX' == dataConf[faxServiceCode].BaseCode && 'service' == dataConf[faxServiceCode].type) {
            fax = new Product(faxServiceCode);
        } else {
            modelCart.addProduct(faxHosting);
            return false;
        }
    
        $modal.find('.js_fax_type').text(faxLimit);
        $modal.find('.js_title_modal').text(faxLimit + ' Fax to Email');
        $modal.foundation('reveal', 'open');

        $modal.find('.js_fax_modal_close').click(function () {
            $modal.foundation('reveal', 'close');
        });
        $modal.find('.js_fax_save').click(function () {
            if (!$modal.find('form').validationEngine('validate')) {
                return false;
            }
            fax.options = {
                email: $modal.find('.js_fax_email').val(),
                password: $modal.find('.js_fax_pass').val()
            };
            fax.hidden = true;
            faxHosting.assignProduct(fax);
            modelCart.addProduct(faxHosting);
            $modal.foundation('reveal', 'close');
        });
    };
    
    landingPage.prototype.addAddon = function(code) {
        if(/DOMAINPRIVACY/.test(code)) {
            var allProducts = modelCart.getProductsByType('domain');
            for (var i = 0, l = allProducts.length; i < l; i++) {
                var product = allProducts[i];
                if(product.tld == '.us' || product.tld == '.ca' ||
                    product.findServiceByBaseCode(code) !== false) {
                    continue;
                }
                product.assignProduct(new Product(code));
            }
            app.eventManager.dispatchEvent('Cart.Updated');
        }
    };
    
    landingPage.prototype.addProduct = function(productCode) {
        var product = dataConf[productCode];
        if(!product) { return false; }
        switch(product.SushiGroup) {
            case 'SSL':
                var ssl = new Product(product.Code);
                var dedicated = new Product('YDEDICATEDIP2');
                dedicated.term = parseInt(ssl.term);
                ssl.assignProduct(dedicated);
                modelCart.addProduct(ssl);
                break;
            case 'Fax':
                this.addFax(product);
                break;
            case 'Fax Hosting':
                this.addFaxHosting(product);
                break;
            case 'Addon':
                this.addAddon(product.Code);
                 break;
            case 'Email':
            case 'Hosting':
            case 'Logo':
            case 'Psprint':
            case 'Bundle':
            case 'LocalSync':
            default:
                modelCart.addProduct(new Product(product.Code));
                break;
        }
    };
    
    landingPage.prototype.init = function() {
        var hash = location.hash;
        if(hash.indexOf('#addProduct=') !== -1) {
            this.addProduct(hash.replace('#addProduct=',''));
        }
    };
    app.register('service', 'landing_page', landingPage);
})(Signup, jQuery);;
