(function(app,$){

	var resetStep = false;
	var disableNextTab = false;
	var setStatusNextTab = function(){
		disableNextTab = true;
	};
  var cart = app.getModel('cart');
	var sushi_flow = function(){
        this.init();
    };

    extend(sushi_flow, app._constructors._services.main);

    sushi_flow.prototype.init = function () {
        app.eventManager.addListener('Signup.allSubmitSuccess','Build.Next.Step', this.action.bind(this));
        app.eventManager.addListener('Purchase.Success','Disable.Tabs', this.disableTabs.bind(this));
        app.eventManager.addListener('Purchase.Success','Disable.Tabs', setStatusNextTab.bind(this));
        app.eventManager.addListener('SushiFlow.Redirect','SushiFlow.Redirect', this.redirect.bind(this));
        app.eventManager.addListener('Build.Next.Step','Build.Next.Step', this.action.bind(this));
        app.eventManager.addListener('SushiFlow.BuildStep','initialising.foundation', this.initFoundation.bind(this));
    };

    sushi_flow.prototype.initFoundation = function() {
      $(document).foundation();
    };
    
    sushi_flow.prototype.action = function(){
        if ( Drupal.sushiFlow != undefined) {
            var next = Drupal.sushiFlow.NextStep();
            if (disableNextTab) Drupal.sushiFlow.disableAllTab(next);
			      disableNextTab = false;
            if ( next === false ){
                this.redirect();
            }
        } else {
			this.redirect();
		}

    };

    sushi_flow.prototype.redirect = function(){
      if (resetStep) this.resetActiveStep();

      var flowId = localStorage.getItem('Flow.FlowId') || false;
      if ( flowId === false ) return false;

      var flow = Drupal.settings.flows[flowId] || false;
      if ( flow === false ) return false;

      // var page = location.pathname.replace(/^.*[\/]/i,'');
      var page = location.pathname;
      var pageId = flow.indexOf(page);
      if ( pageId == -1 ) return false;

      pageId = ++pageId;
      if ( flow.length == pageId ) return false;
      this.resetActiveStep();
      var checkResult = cart.checkCart();
      if(checkResult.message) {
        $.jGrowl(checkResult.message);
        return false;
      }
      location.pathname = flow[pageId];
      return true;
    };

	sushi_flow.prototype.resetActiveStep = function () {
		var sf = Drupal.settings.sushi_flow;
		if ( sf != undefined && sf.quicktab != undefined ) {
			var wizard = sf.quicktab;
			var dataStep = JSON.parse(localStorage.getItem('Flow.Step')) || {};
			delete dataStep[wizard];
			localStorage.setItem('Flow.Step',JSON.stringify(dataStep));
		}
		resetStep = false;
	};

	sushi_flow.prototype.disableTabs = function () {
		if ( !Drupal.sushiFlow ) return;

		Drupal.sushiFlow.disableAllTab();
		resetStep = true;
	};


    app.register('service', 'sushi_flow', sushi_flow);

})(Signup,jQuery);;
