(function(app,$){
    var hosting_options_redirect = function(dom){
        this.dom = dom;
        this.init();
    };

    extend(hosting_options_redirect, app._constructors._services.main);

    hosting_options_redirect.prototype.init = function(){
        app.eventManager.off('Signup.Modules.NextStep','nextStepModulesService');
        app.eventManager.addListener('Cart.Add','Redirect', this.redirect.bind(this));

    };
    hosting_options_redirect.prototype.redirect = function(){
        var products = app.getModel('cart').getAllProducts();
        var domainFlag = false;
        var hostingFlag = false;

        for ( product in products ){
            var typeOfProduct = products[product].type;
            if ( 'domain' === typeOfProduct ){
                domainFlag = true;
            } else if ( 'package' === typeOfProduct ){
                hostingFlag = true;
            }
        }
        if ( false === domainFlag && true === hostingFlag ){
            app.eventManager.dispatchEvent('SushiFlow.Redirect');
        } else if ( true === domainFlag && false === hostingFlag ){
              app.eventManager.on('Signup.Modules.NextStep','nextStepModulesService');
        }
    };
    hosting_options_redirect.prototype.submit = function(){
        var $deff = new $.Deferred();
        var count = app.getModel('cart').getAllProducts().length;
        if ( 0 !== count ){
            $deff.resolve('hosting_options_redirect: Ok');
            this.redirect();
        } else {
            $deff.reject('hosting_options_redirect: Reject - empty');
            $.jGrowl('Please add domain or hosting to continue.', { theme: 'su-error'});
        }
        return $deff.promise();
    };

    app.register('service', 'hosting_options_redirect', hosting_options_redirect);

})(Signup,jQuery);
