(function(app, $) {
    var modelCart = app.getModel('cart');
    var siteLock = function (dom) {
        this.$dom = $($(dom).html());
        this.init();
    };
    
    extend(siteLock, app._constructors._services.main);   
    
    siteLock.prototype.add = function(product) {
        setTimeout(function() {
           var domains = modelCart.getProductsByType('domains');
            if(domains.length && (product.getParam('SushiGroup') === 'Hosting'
                                  || product.getParam('SushiGroup') === 'Domain')) {
                domains.forEach(function(domain) {
                    if(domain.parent !== false 
                       && domain.parent.getParam('SushiGroup') === 'Hosting' 
                       && domain.findServiceByBaseCode('YSITELOCKBASIC') === false 
                       && domain.findServiceByBaseCode('YSITELOCKPRO') === false) {
                        domain.assignProduct(new Product('YSITELOCKPRO'));
                    }
                });
            } 
        }, 50);
    };
    
    siteLock.prototype.remove = function(product) {
        setTimeout(function() {
           var domains = modelCart.getProductsByType('domains');
            if(domains.length) {
                if(product.getParam('SushiGroup') === 'Hosting' && product.getParam('PType') === 'Package') {
                    domains.forEach(function(domain) {
                        var basic = domain.findServiceByBaseCode('YSITELOCKBASIC');
                        var pro = domain.findServiceByBaseCode('YSITELOCKPRO');
                        if((domain.parent === false 
                           || domain.parent.getParam('SushiGroup') !== 'Hosting')
                           && (basic !== false || pro !== false)) {
                            
                            modelCart.removeProduct(domain.assignedProducts[basic + pro]);
                        }
                   });
                } else if(product.code === 'YSITELOCKPRO') {
                    domains.forEach(function(domain) {
                        var basic = domain.findServiceByBaseCode('YSITELOCKBASIC');
                        var pro = domain.findServiceByBaseCode('YSITELOCKPRO');
                        if((domain.parent !== false
                           && domain.parent.getParam('SushiGroup') === 'Hosting')
                           && basic === false 
                           && pro === false) {
                            domain.assignProduct(new Product('YSITELOCKBASIC'));
                        }
                   });
                }
            } 
        }, 50);
    };
    
    siteLock.prototype.update = function(params) {
        if(params.event === 'add') {
            this.add(params.product);
        } else if(params.event === 'remove') {
            this.remove(params.product);
        }
    }
    
    siteLock.prototype.init = function() {
        app.eventManager.addListener('Cart.Updated','assocDomainServiceRedirect', this.update.bind(this));
    };
    app.register('service', 'site_lock_service', siteLock);
})(Signup, jQuery);;
(function(app,$){
  var ctrlDomain = app.getCtrl('domain');

  function wizard_bundle ($dom) {
    this.bundleCode = localStorage.getItem('bundle.lastAdded') || false;
    if ( Drupal.settings.sushi_flow &&
         Drupal.settings.sushi_flow.quicktab == 'product_bundling' &&
         this.bundleCode) {

      this.steps = Drupal.settings.sushi_flow.onSteps = {
        '0': false,
        '1': false,
        '2': false,
        'wizard': 'product_bundling'
      }

      this.init();
    }
  }

  extend(wizard_bundle, app._constructors._services.main);

  wizard_bundle.prototype.init = function(){
    app.eventManager.addListener('Domain.Search.Success','WizardBundle.NextStep', this.nextStep.bind(this));
    app.eventManager.addListener('WizardBundle.NextStep','WizardBundle.NextStep', this.nextStep.bind(this));
    var bundle = dataConf[this.bundleCode];

    for (var i in bundle.Products) {
      try {
        this.stepOn( dataConf[bundle.Products[i]].SushiGroup );
      } catch(e) {
        console.log(e);
      }
    }

    this.build();
  }

  wizard_bundle.prototype.stepOn = function( type ){
    switch(type){
      case 0:
      case '0':
      case 'Domain':
      case 'Hosting':
      //case 'SSL':
        this.steps["0"] = true;
        break;
      case 1:
      case '1':
      case 'Email':
        this.steps["0"] = true;
        this.steps["1"] = true;
        break;
      case 2:
      case '2':
      case 'Fax':
        this.steps["2"] = true;
    }
  }

  wizard_bundle.prototype.build = function(){
    Drupal.sushiFlow.init();
  }

  wizard_bundle.prototype.nextStep = function(){
    if (ctrlDomain.findResult() == 'available') {
      app.eventManager.dispatchEvent('Build.Next.Step');
    }
  }

  app.register('service', 'wizard_bundle', wizard_bundle);

}(Signup, jQuery));
